757=>["Value"=>757,"TextKey"=>"原石资源弹窗描述","TextValue"=>"<line-height=135%>획득 경로: <br>1. '빛나는 넝쿨'에서 추출한 대지의 마법을 합성합니다<br>2. 정원 상점에서 구매<br>3. <color=#f58c26>원석 창고</color>를 만들어 더 많은 원석<br>을 보관합니다용도: <br>1. <color=#f58c26>긴 집</color><br> 건설합니다2. <color=#f58c26>금고</color>와 <color=#f58c26>원석 창고</color>를 건설합니다"],
758=>["Value"=>758,"TextKey"=>"弹框英雄迷雾界面内容","TextValue"=>"<line-height=175%>잠금 해제 조건: 잠금 해제 필요{0} <br>모험을 하는 동안 '영웅'을 발견해야 합니다"],
