12683=>["Value"=>12683,"TextKey"=>"新手引导说明2001","TextValue"=>"저는 이 <color=#38c0a5>토템</color>속에 갇혔습니다."],
12684=>["Value"=>12684,"TextKey"=>"新手引导说明2002","TextValue"=>"임의의 <color=#38c0a5>토템</color>을 끌고 와서, 3개의 <color=#38c0a5>토템</color> 을 서로 가까이 놔두면 자동으로 합성이 되어 봉인이 풀리게 됩니다!"],
12685=>["Value"=>12685,"TextKey"=>"新手引导说明2010","TextValue"=>"아! 여기에는 <color=#38c0a5>토템</color>이 없습니다."],
12686=>["Value"=>12686,"TextKey"=>"新手引导说明2011","TextValue"=>"보세요! <color=#f58c26>창조신의 법전</color>이에요, 각 스테이지에서 그것을 볼 수 있고, 그것들의 기록은 반드시 당신에게 도움이 될 거예요."],
12687=>["Value"=>12687,"TextKey"=>"新手引导说明2012","TextValue"=>"그것을 클릭하면, 게임에 대한 설명을 볼 수 있어요, 한 번 해보세요!"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2020","TextValue"=>"스테이지를 클리어하려면, 요구 사항에 따라 지정한 아이템을 획득해야 합니다."],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2022","TextValue"=>"스테이지 목표에는 당신이 획득해야 할 아이템이 표시됩니다. 합성을 시작해서 클리어하세요!"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"와! <color=#ef933d>창조신의 소녀 조각상</color>! 그녀들의 힘도 약해졌어요! 합성을 통해 그녀를 각성시켜야 합니다!"],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"<color=#ef933d>창조신의 소녀 조각상</color>이 있는 스테이지에서는 보통 그녀들을 합성하여야 클리어 수 있습니다."],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2032","TextValue"=>"이 땅은 <color=#f58c26>창조의 여신</color>과 연결을 잃고 깊은 잠에 빠져 버렸어요."],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2033","TextValue"=>"당신은 <color=#38aec0>침묵의 땅</color>의 어떤 것도 가져갈 수 없습니다!"],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2034","TextValue"=>"임의의 <color=#38c0a5>영기의 꽃</color>을 합성하여 땅을 깨우세요."],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2035","TextValue"=>"스테이지를 승리하면 <color=#f58c26>창조의 여신</color>이 주술사에 의해 저주받은 모든 땅을 각성시킬 거예요!"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2040","TextValue"=>"보세요! <color=#38c0a5>토템</color>입니다!"],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2041","TextValue"=>"빨리 3개의 <color=#38c0a5>토템</color>을 합성하여 부족원을 구하세요!"],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"아까 말씀드렸지만, <color=#38c0a5>대지의 구슬</color>을 클릭하면 땅을 각성시킬 수 있습니다."],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2051","TextValue"=>"물론 당신도 합성을 통해서 더 높은 등급의 대지의 <color=#38c0a5>대지의 구슬</color>을 얻을 수 있습니다."],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2060","TextValue"=>"일반 아이템과 <color=#38aec0>침묵의 땅</color>에 있는 동일한 아이템을 합성하면, <color=#38aec0>침묵의 땅</color>이 자동으로 각성하게 됩니다."],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2070","TextValue"=>"<color=#38c0a5>토템</color>을 클릭하여 무더기에서 '<color=#38c0a5>토템</color>'을 획득하세요."],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"일부 <color=#38aec0>잠자는 땅<color=#38aec0>은 <color=#38aec0>치유 포인트</color>에 의해 각성하지 못하고 오직 일반 땅의 아이템을 합성하는 방식으로 각성합니다."],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"지금부터 스테이지에는 임무가 있습니다."],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2091","TextValue"=>"임무 태양을 클릭하여 내용과 보상을 확인할 수 있습니다."],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"이 키는 화면 드래그를 잠그거나 잠금을 해제할 수 있습니다."],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"일부 아이템은 직접 합성할 수 없으며, 당신은 <color=#ef933d>설형석무지</color>를 클릭하여 다른 <color=#ef933d>설형석</color>으로 변환하여 합성을 진행할 수 있습니다."],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"스테이지의 통과 목표를 확인해야 합니다."],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"우리는 각종 <color=#38c0a5>용의 뼈</color>로부터, <color=#ef933d>관목 씨앗</color>을 얻을 수 있습니다."],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"이것은 초대형 <color=#ef933d>각성 폭탄</color>입니다. 만약 땅을 각성하면 인접한 땅은 저절로 각성하게 됩니다. 이렇게 각성할 시, 사방 1칸의 땅을 동시에 각성합니다."],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"부족원은 더 높은 레벨의 <color=#38c0a5>넝쿨</color>에서 <color=#38c0a5>원석덩어리</color>을 채집할 수 있습니다. 클릭하면 수집할 수 있습니다."],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"이것은 <color=#ef933d>부서진 묘비</color>입니다. 그냥 두거나 합성하면 무서운 강시로 변합니다. 강시를 죽이면 <color=#38c0a5>반딧불</color> 아이템을 얻을 수 있으며. 이 스테이지를 통과하는 데 꼭 필요한 아이템입니다."],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"<color=#ef933d>황폐한 둥지</color>는 각성 상태와 상관없이 지속적으로 강시를 생성시킵니다. 클릭하면 바로 강시가 생성됩니다. <color=#ef933d>황폐한 소굴</color>을 파괴하면 대량의 원석덩어리를 얻을 수 있습니다."],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"이것은 <color=#ef933d>드루이드의 룬 포탈</color>입니다. 정말 운이 좋네요! 이것들을 합성하면 영지에서 임의의 <color=#38c0a5>부족원<color=#38c0a5>을 불러 도움을 받을 수 있습니다."],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"창조신의 나무가 남긴 성물은 자동으로 <color=#38c0a5>대지의 구슬</color>을 생성하여 땅을 각성시킵니다. 창조신의 나무가 남긴 성물은 등급이 높을수록 치유력이 뛰어납니다."],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>"이곳에서는 <color=#ef933d>황야의 구름</color>이 지속적으로 출현하며, 그것을 클릭하여 비가 내리도록 하세요. 비가 내리는 범위 안의 빈 땅에는 <color=#38c0a5>물웅덩이</color>와 <color=#38c0a5>영기의 꽃</color>이 지속적으로 자라납니다."],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"이상하다, <color=#ef933d>창조신의 소녀상</color>은 어디에 있어요?"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"아 참, 당신이 임무를 완수하면 그녀들이 나타날 거예요!"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"이것은 <color=#ef933d>마신 조각상</color>입니다. 흉측한 물건입니다! 당신의 부족원들에게 그것을 없애라고 명령하면 <color=#ef933d>창조신의 소녀상</color>을 얻을 수 있습니다."],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"새로운 영지가 열렸으니, 빨리 <color=#f58c26>세계지도</color>에 가서 확인해보세요."],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"저희는 다시 자유를 얻었습니다, 감사합니다."],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"저희 부족들은 모두 이 <color=#38c0a5>토템</color>속에 갇혔습니다."],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"당신은 저희 부족을 구하고 갇혀있는 다른 부족원들을 찾아야 합니다."],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"다음 스테이지로 가서 찾아보세요!"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"아이템을 더블클릭하거나 부족원을 아이템에 끌어다 채집하게 할 수도 있습니다."],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"채집한 아이템은 당신이 사용하거나 합성할 수 있습니다."],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"<color=#38c0a5>영기의 꽃</color>을 채집하면 <color=#38c0a5>구슬</color>을 획득할 수 있습니다."],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#38c0a5>구슬</color>을 클릭하면 침묵의 땅을 각성할 수 있습니다."],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"지금부터 스테이지 종료 시 보상을 선택할 수 있습니다."],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"보상은 보통 일반 금전과 다른 유용한 아이템이 있습니다. 간혹 <color=#38c0a5>토템</color> 한 개도 획득할 수 있습니다."],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"당신의 보상은 <color=#38aec0>대지의 풍선</color>에 담겨서 <color=#f58c26>정원</color>으로 보내질 것입니다."],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"이것이 바로 우리의 <color=#f58c26>정원</color>입니다."],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"저희 부족은 일찍이 이곳에서 생활하였으나, 그 대홍수로 <color=#f58c26>정원</color>이 파괴되었고 안개가 이 땅을 덮어서 부득이하게 고향을 떠나야만 했습니다."],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"아이템을 <color=#38aec0>침묵의 땅</color>에 있는 아이템과 합성하면 그곳을 바로 각성시킬 수 있습니다. 아이템을 합성하여 부족원들을 해방시켜 보세요, 그러면 많은 안개를 걷어낼 수 있을 겁니다."],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"<color=#38c0a5>시간보물상자</color>은 최대 1개만 열 수 있으며, 제한시간이 끝나면 보상을 받을 수 있습니다. <color=#38c0a5>보석</color>을 소모하여 원하는 <color=#38c0a5>시간보물상자</color>를 열 수도 있습니다."],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"스테이지에서 받은 보상은 여기로 보냈으니 버블을 열어서 확인해보세요."],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<color=#38c0a5>긴 집</color>은 부족원들이 휴식하는 장소이며, 일정 시간이 지나면 부족원들이 다시 활동할 수 있습니다."],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"<color=#38c0a5>긴 집</color>은 보다 고급스러운 긴 집으로 합성할 수 있으며, 긴 집의 등급이 높을수록 이에 대응하는 데 필요한 휴식시간이 짧습니다."],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"<color=#38c0a5>보석</color>을 사용하여 바로 각성시킬 수 있습니다."],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"<color=#f58c26>정원</color> 임무를 완료하여 더 많은 <color=#38c0a5>대지의 유산</color>을 얻을 수 있으며, <color=#38c0a5>대지의 유산</color>을 클릭하면 특수 전리품을 얻을 수 있습니다."],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"이것은 하나의 작은 <color=#38c0a5>금광</color>입니다."],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"이것을 클릭하여 일반 금전을 획득할 수 있으며, 또한 높은 등급의 <color=#38c0a5>금광</color>을 합성할 수 있습니다."],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<color=#38c0a5>금광</color> 자원은 <color=#f58c26>상점</color>에서 사용할 수 있습니다."],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<color=#38c0a5>금광</color>이 꽉 찼나요? <color=#f58c26>상점</color>에 가서 좋은 아이템을 구매해 보세요!"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"모든 <color=#df66a8>부족원</color>들의 힘이 빠져서 잠시 동안 휴식이 필요합니다."],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"이제 더 많은 스테이지에 도전해서 더 많은 부족원을 구출해 보세요!"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"당신이 가지고 있는 부족원이 많을수록, 그들이 휴식을 취하기 전에, 채집할 수 있는 아이템이 많아집니다!"],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"스테이지 클리어를 하면 더 많은 부족원들을 구출할 수 있습니다."],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"그리고 그들을 데리고 집으로 갈 수 있습니다!"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"보세요! 여기서 <color=#f58c26>세계지도</color>를 통해서 스테이지까지 갈 수 있습니다!"],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"둘 곳이 없습니다! 바닥에는 이미 가득 깔려있습니다!"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"아이템을 선택한 후, 정보 창에서 판매하거나 삭제할 것을 선택하세요."],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"이것은 <color=#38c0a5>별의 유산</color>으로 매우 희귀합니다! 이것을 클릭하여 <color=#38c0a5>보석</color>을 획득하거나, 합성하여 더 높은 등급의 '별의 유산'을 획득할 수 있습니다."],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"이것은 <color=#38c0a5>원석</color> 부스러기입니다."],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"이것을 클릭하여 <color=#38c0a5>원석</color>자원 획득할 수 있으며, 더 높은 원석덩어리으로 합성할 수도 있습니다."],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<color=#38c0a5>원석</color> 자원은 <color=#f58c26>상점</color>에서 사용할 수 있습니다."],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"<color=#38c0a5>원석</color>이 꽉 차면 <color=#f58c26>상점</color>에서 아이템을 구매하여 소모하면 됩니다."],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"이것은 얄미운 <color=#38c0a5>바리케이드</color>로, 평소에 이동시킬 수 없습니다. <color=#df66a8>부족원</color>에게 명령하거나 <color=#38c0a5>바리케이드</color>를 더블클릭하여 공격할 있습니다. <color=#38c0a5>바리케이드</color>를 부수면, 작은 <color=#38c0a5>바리케이드</color>가 생성될 수 있습니다."],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"각성하지 않은 <color=#38c0a5>포대</color>도 주변의 오염된 땅을 공격할 수 있습니다. 진도표는 포의 사격 거리를 표시합니다. 그러나 각성해야지만 공격이 가능합니다!"],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"이것은 <color=#f58c26>영웅 제단</color>입니다. 영웅은 휴식과 순찰 상태에서 전환이 가능합니다."],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"영웅이 있을 때, 임의의 4명의 영웅 조합에는 추가 효과가 있습니다!"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"휴식 중이라면 <color=#38c0a5>보석</color>를 사용하여 바로 각성시킬 수 있습니다."],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"여기를 클릭하면 영웅 관련 정보를 확인할 수 있습니다."],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"영웅은 부족의 강력한 캐릭터로서 독특한 기능을 가지고 있습니다."],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"영웅 스킬, 이 영역에서는 영웅 스킬의 설명을 볼 수 있습니다."],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"임무를 제출하여 영웅의 등급을 올릴 수 있습니다."],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"모든 임무 내용을 완수하면 즉시 영웅의 등급을 올릴 수 있습니다."],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"잘하셨습니다. 더 많은 부족원이 봉인을 해제했습니다!"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"부족의 인구가 많을수록 더 많은 안개를 없앨 수 있습니다!"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"각 지역의 안개는 일정 수준의 <color=#f58c26>부족의 힘</color>이 있어야 제거할 수 있습니다."],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"현재 클릭하여서 제거할 수 있는 안개가 있습니다."],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"눈앞의 안개는 제거할 수 없습니다."],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"당신의 <color=#f58c26>부족의 힘</color>이 부족합니다, <color=#f58c26>상점</color>에 가서 더 많은 <color=#38c0a5>토템</color>을 구매할 수 있습니다."],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"일반 금전을 사용하여 <color=#38c0a5>토템</color>를 구매할 수 있습니다."],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"매번 구매 후 <color=#38c0a5>토템</color>은 가격이 오르니, 빨리 가서 더 많은 일반 금전을 수집하세요."],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"이것은 <color=#f58c26>시간제 스테이지</color>로 제한된 시간 안에 클리어해야 합니다. 그렇지 않으면 도전에 실패할 수 있습니다."],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"아래에서 스테이지의 남은 시간을 확인 할 수 있습니다."],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"시간이 줄어들수록 숫자 색상은 <color=#46bb83>녹색</color>에서 <color=#eca852>노란색</color>으로 그리고 <color=#e04030>빨간색</color>으로 바뀝니다."],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"클리어 효율을 높이기 위해서는 <color=#f58c26>상점</color>을 한 번 확인해 보세요."],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"바로 <color=#38c0a5>보석</color>을 사용해도 되지만, <color=#f58c26>상점</color>에서 중요한 아이템을 구매할 수 있습니다."],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"이러한 스테이지는 클리어하게 되면 <color=#df66a8>부족원</color>을 보상으로 받을 수 있습니다. <color=#38c0a5>보석</color>을 사용하면 두 배의 보상을 획득할 수 있습니다."],
12781=>["Value"=>12781,"TextKey"=>"新手引导说明2290","TextValue"=>"다시 한번 스테이지에 오신 것을 환영합니다, 이번에도 스테이지를 통과하면 보상을 받을 수 있습니다."],
12782=>["Value"=>12782,"TextKey"=>"新手引导说明2291","TextValue"=>"각각의 스테이지는 <color=#f58c26>3회 완료</color>할 수 있지만, 제한 시간이 점점 줄어들 것입니다."],
12783=>["Value"=>12783,"TextKey"=>"新手引导说明3149","TextValue"=>"영웅 업그레이드에는 대기시간이 필요하며, <color=#38c0a5>보석</color>사용하여 업그레이드를 가속화할 수도 있습니다."],
12784=>["Value"=>12784,"TextKey"=>"新手引导说明2300","TextValue"=>"보세요! 여기 <color=#46bb83>끼워 넣을 수 있는 구멍</color>이 있는데, 이것이 땅의 안개를 제어하고 있습니다."],
12785=>["Value"=>12785,"TextKey"=>"新手引导说明2301","TextValue"=>"상응하는 아이템을 기관으로 끌어당기면 잠금이 해제됩니다."],
12786=>["Value"=>12786,"TextKey"=>"新手引导说明2302","TextValue"=>"만약 기관이 잠들어 있다면, 먼저 각성시켜야 해요"],
12787=>["Value"=>12787,"TextKey"=>"新手引导说明2400","TextValue"=>"<color=#46bb83>이벤트 스테이지</color>에 오신 것을 환영합니다. 한시적으로 여는 스테이지입니다."],
12788=>["Value"=>12788,"TextKey"=>"新手引导说明2401","TextValue"=>"<color=#46bb83>이벤트 스테이지</color>는 보상이 풍부하며 게다가 <color=#f58c26>정원</color>으로 보상을 보내줍니다."],
12789=>["Value"=>12789,"TextKey"=>"新手引导说明2402","TextValue"=>"독특한 기능의 아이템과 게임이 있습니다..."],
12790=>["Value"=>12790,"TextKey"=>"新手引导说明3180","TextValue"=>"<color=#f58c26>횃불</color>은 스테이지에 도전할 수 있도록 지원하는 필수 자원으로, 시간이 지날수록 서서히 복구됩니다."],
12791=>["Value"=>12791,"TextKey"=>"新手引导说明3181","TextValue"=>"현재 <color=#f58c26>횃불</color>이 모두 찼습니다. 빨리 소모하세요!"],
12792=>["Value"=>12792,"TextKey"=>"新手引导说明1072","TextValue"=>"지금부터 <color=#38c0a5>영지 보상</color>을 확인할 수 있습니다."],
12793=>["Value"=>12793,"TextKey"=>"新手引导说明1073","TextValue"=>"<color=#f58c26>대기시간</color>이 끝나면, 보물상자를 수령할 수 있습니다."],
12794=>["Value"=>12794,"TextKey"=>"新手引导说明1074","TextValue"=>"스테이지에서 <color=#f58c26>별</color>을 많이 받을수록 더 풍부한 보상을 받을 수 있습니다."],
12795=>["Value"=>12795,"TextKey"=>"新手引导说明2235","TextValue"=>"보세요! 지도의 <color=#f58c26>저곳에</color> 위치하고 있습니다. 어서 가서 잠금을 해제하고 확인해 보세요!"],
12796=>["Value"=>12796,"TextKey"=>"新手引导说明2310","TextValue"=>"저희의 척후가 또 새로운 <color=#d0603e>영지<color=#967357>를 발견했으니, 빨리 가서 확인해 보세요."],
12797=>["Value"=>12797,"TextKey"=>"新手引导说明2315","TextValue"=>"어쩌면 저희는 이곳에서 유쾌한 새 동료를 만날 수도 있습니다!"],
12798=>["Value"=>12798,"TextKey"=>"新手引导说明2320","TextValue"=>"<color=#46bb83>빙설휴가 이벤트</color>에 오신 것을 환영합니다, 멋진 세계가 당신의 탐험을 기다리고 있습니다!"],
12799=>["Value"=>12799,"TextKey"=>"新手引导说明2321","TextValue"=>"<color=#46bb83>이벤트</color>는 풍부한 보상이 있습니다. 이 보상들은 <color=#f58c26>정원</color>으로 보내집니다!"],
12800=>["Value"=>12800,"TextKey"=>"新手引导说明2322","TextValue"=>"새로운 아이템과 부족원 그리고 새로운 놀이가 당신의 체험을 기다리고 있습니다!"],
12801=>["Value"=>12801,"TextKey"=>"新手引导说明2330","TextValue"=>"<color=#46bb83>동화마을</color>에 오신 것을 환영합니다, 멋진 세계가 당신의 탐험을 기다리고 있습니다!"],
12802=>["Value"=>12802,"TextKey"=>"新手引导说明2331","TextValue"=>"<color=#46bb83>이벤트</color>는 풍부한 보상이 있습니다. 이 보상들은 <color=#f58c26>정원</color>으로 보내집니다!"],
12803=>["Value"=>12803,"TextKey"=>"新手引导说明2332","TextValue"=>"새로운 아이템과 부족원 그리고 새로운 놀이가 당신의 체험을 기다리고 있습니다!"],
