12808=>["Value"=>12808,"TextKey"=>"新手引导说明2352","TextValue"=>"여기에는 모든 이벤트 포인트 보상이 전시되어 있습니다. 충분한 포인트를 획득할 경우, 해당 포인트에 대한 보상이 바로 당신의 정원으로 지급됩니다!"],
12809=>["Value"=>12809,"TextKey"=>"新手引导说明2353","TextValue"=>"당신이 획득한 포인트가 많을수록 획득할 수 있는 보상도 많아집니다! 즐거운 시간 보내세요!"],
12810=>["Value"=>12810,"TextKey"=>"新手引导说明3200","TextValue"=>""일일 퀘스트"가 시작되였습니다, 어서 확인해 보세요!"],
12811=>["Value"=>12811,"TextKey"=>"新手引导说明3203","TextValue"=>"일일 퀘스트는 여러개 입니다, 하나 씩 완성할 때마다 보상을 획득할 수 있습니다."],
12812=>["Value"=>12812,"TextKey"=>"新手引导说明3205","TextValue"=>"모든 퀘스트를 완료하면 보너스가 주어집니다!"],
