12828=>["Value"=>12828,"TextKey"=>"新手引导说明2510","TextValue"=>"함께 <color=#46bb83>장난감 천국</color>, 어린 시절 꿈에 진입해요!!"],
12829=>["Value"=>12829,"TextKey"=>"新手引导说明2511","TextValue"=>"<color=#46bb83>이벤트</color>에 참여하면 푸짐한 보상이 있습니다. 이 보상들은 이벤트가 끝난 후 <color=#f58c26>정원</color>으로 보내집니다!"],
