12833=>["Value"=>12833,"TextKey"=>"新手引导说明2523","TextValue"=>"당신이 획득한 포인트가 많을수록 획득할 수 있는 보상도 많아집니다! 즐거운 시간 보내세요!"],
12834=>["Value"=>12834,"TextKey"=>"新手引导说明2530","TextValue"=>"아름다운 여름에 <color=#46bb83>해변 휴가</color>를 놓칠 수 없죠!"],
12835=>["Value"=>12835,"TextKey"=>"新手引导说明2531","TextValue"=>"<color=#46bb83>이벤트</color>에 참여하면 푸짐한 보상이 있습니다. 이 보상들은 이벤트가 끝난 후 <color=#f58c26>정원</color>으로 보내집니다!"],
12836=>["Value"=>12836,"TextKey"=>"新手引导说明2532","TextValue"=>"새로운 아이템과 부족원 그리고 새로운 놀이가 당신의 체험을 기다리고 있습니다!"],
12837=>["Value"=>12837,"TextKey"=>"新手引导说明2534","TextValue"=>"<color=#df66a8>빠른 인부</color>를 건축물이나 아이템에 드래그해 건설을 진행하세요. 짧은 건설을 순식간에 완료하거나, 긴 건설을 1시간 앞당길 수 있답니다."],
12838=>["Value"=>12838,"TextKey"=>"新手引导说明2540","TextValue"=>"<color=#f58c26>영웅의 집</color>에 오신 걸 환영합니다. 수많은 영웅들과 이야기가 숨겨져있으니 어서 발견해보세요!"],
12839=>["Value"=>12839,"TextKey"=>"新手引导说明2541","TextValue"=>"드래그를 통해 <color=#ef933d>공주의 드레스</color>를 다른 2개와 합성해보세요. 악마의 안개로부터 <color=#df66a8>부족의 공주</color>를 구출해주세요."],
12840=>["Value"=>12840,"TextKey"=>"新手引导说明2542","TextValue"=>"놀랍습니다! 첫 영웅을 구출하셨습니다-- <color=#df66a8>부족의 공주</color>!  <color=#df66a8>부족의 공주</color>가 성의가 담긴 주문을 가져왔습니다. 탭을 통해 확인해보세요!"],
12841=>["Value"=>12841,"TextKey"=>"新手引导说明2543","TextValue"=>"축하드립니다! <color=#ef933d>밀</color>을 해제하셨습니다. 주문 완료를 위한 핵심 재료입니다. <color=#ef933d>밀</color>을 탭해 수령하세요!"],
12842=>["Value"=>12842,"TextKey"=>"新手引导说明2544","TextValue"=>"<color=#38c0a5>주문서</color>를 통해 안개를 제거해 더 많은 영웅을 해방할 수 있습니다. 주문을 완료함으로써 더 많은 <color=#38c0a5>주문서</color>를 획득할 수 있습니다."],
12843=>["Value"=>12843,"TextKey"=>"新手引导说明2631","TextValue"=>"My Kingdom and my people are lost in the fog! Can you please <color=#ef933d>Merge</color> three Imperial Crowns to help me?"],
12844=>["Value"=>12844,"TextKey"=>"新手引导说明2633","TextValue"=>"Hey! I am the Old King Hill! It seems like you are the one who woke me up!"],
12845=>["Value"=>12845,"TextKey"=>"新手引导说明2636","TextValue"=>"<color=#ef933d>Merge 3 items</color> of the <color=#ef933d>Same Kind</color> together to clear fog and unlock <color=#ef933d>New heroes</color> and other fun things."],
12846=>["Value"=>12846,"TextKey"=>"新手引导说明2637","TextValue"=>"Drag this plant onto the other two. It will be leveled up to a <color=#ef933d>New Plant</color>. Give it a try!"],
12847=>["Value"=>12847,"TextKey"=>"新手引导说明2639","TextValue"=>"Good job! Keep merging by dragging this plant onto the others. You will get an upgraded <color=#ef933d>New Plant</color>."],
12848=>["Value"=>12848,"TextKey"=>"新手引导说明2641","TextValue"=>"Keep merging the plants. You will get a <color=#ef933d>New Plant</color> of the next level."],
12849=>["Value"=>12849,"TextKey"=>"新手引导说明2643","TextValue"=>"Repeat this move and see what is the <color=#ef933d>New Plant</color> looks like."],
12850=>["Value"=>12850,"TextKey"=>"新手引导说明2645","TextValue"=>"Last step! Drag the plant you just got onto the other two same ones and you'll get a <color=#ef933d>New Plant</color> ready for harvest! "],
12851=>["Value"=>12851,"TextKey"=>"新手引导说明2649","TextValue"=>"Ahh! It's bread! It smells soo good! Let me have a taste!"],
12852=>["Value"=>12852,"TextKey"=>"新手引导说明2652","TextValue"=>"Use the spellbook now to see what's gonna happen!"],
12853=>["Value"=>12853,"TextKey"=>"新手引导说明2663","TextValue"=>"Let's try merge 5 things together and see what's gonna happen！"],
12854=>["Value"=>12854,"TextKey"=>"新手引导说明2665","TextValue"=>"Anytime when you merge 5 items together, you will get <color=#ef933d>2 Items</color> of the next level. Don't forget the rules of <color=#ef933d>3 Merge</color> and <color=#ef933d>5 Merge</color>!"],
12855=>["Value"=>12855,"TextKey"=>"新手引导说明2671","TextValue"=>"Attention! This <color=#ef933d>Crystal</color> looks magical. Let's see what's going to happen if we merge three crystals together!"],
12856=>["Value"=>12856,"TextKey"=>"新手引导说明2673","TextValue"=>"<color=#ef933d>Advanced Magic Crytal</color> can be merged with any other two items. Kind of like the wild card in poker games. Try to merge this Magic Crytal with others."],
12857=>["Value"=>12857,"TextKey"=>"新手引导说明2675","TextValue"=>"Remember the <color=#ef933d>Advanced Magic Crytal</color> can be played as a wild card!"],
12858=>["Value"=>12858,"TextKey"=>"新手引导说明2676","TextValue"=>"Use <color=#ef933d>Speedy Workers</color> to complete construction immediately!"],
12859=>["Value"=>12859,"TextKey"=>"新手引导说明2678","TextValue"=>"<color=#ef933d>Speedy Workers</color> have ultra-high efficiency. <color=#ef933d>Drag</color> one onto a building to be constructed to see what's gonna happen!"],
12860=>["Value"=>12860,"TextKey"=>"新手引导说明2686","TextValue"=>"Complete each <color=#ef933d>Task</color> will gain you <color=#ef933d>Experience Points</color> which will upgrade your levels in the game. Tap on the Task button to learn more about it."],
12861=>["Value"=>12861,"TextKey"=>"新手引导说明2688","TextValue"=>"Do you need more <color=#ef933d>Construction Materials</color>，<color=#ef933d>Chests</color> or <color=#ef933d>Other Items</color> for help？Now the Store is open and go check what's on the shelves! There is a <color=#ef933d>Free Chest</color> for you to collect."],
