13616=>["Value"=>13616,"TextKey"=>"天气雷名称100001","TextValue"=>"천둥 번개"],
13617=>["Value"=>13617,"TextKey"=>"天气雷描述100001","TextValue"=>"천둥 번개를 아이템 위에 올려놓으면 같은 아이템끼리 붙습니다."],
13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"좋은 아침입니다. 추장 님! 저는 당신의 충성스러운 정찰병 트리스탄입니다! 비록 여정은 힘들지만 다행히 우리는 살아남았습니다! 드디어 육지를 밟아보네요. 어서 <color=#f58c26>영지</color>를 건설하죠."],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"참 울창하네요! 여기서 어떤 일이 발생될까요? 비바람을 막기 위해 어서 텐트를 설치합시다!"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"어머, 세상에! 이게 다 뭐야...... 이 척박한 땅...... 그리고 이 못난 텐트! 집에 가고 싶어......"],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"엔다 님, 엔다 님에게는 집을 떠나는 게 쉽지 않은 걸 알고 있지만 다른 방법이 없어요. 이번 자연재해가 너무 수상해요...... 우리는 반드시 원인을 찾아야 해요! 우리가 고향을 떠나 도움을 청하는 것도 다 이것 때문이에요."],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"하지만 우리는 집에 돌아갈 방법을 꼭 찾을 거예요, 안 그래요? 신과 소통할 수 있도록 우리가 먼저 <color=#f58c26>제단</color>을 만들어 줄게요. 엔다 님 어때요? 추장님도 도와줄 테니까요!"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"우리가 뭘 찾았는지 좀 봐요! <color=#ef933d>대지의 유산</color>! 이로써 <color=#f58c26>제단</color> 건설에 필요한 재료는 모두 준비되었어요. 그리고 우리는 토템 봉인을 해제하는 방법도 찾았어요! 이곳은 참 복많은 곳이네요!"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"너도 완전한 폐물이 아닌 것 같은데...... 이름은 뭐, 스탄이라는 놈. 이 제단은 우리 집의 것보다 많이 작고 기세도 웅장하지 않지만 쓸 만해. 이제 저리 가라!"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"어머~ 너무 귀엽네요~ 그녀가 정말 기뻐 보이네요! 그리고 그녀의 너무 특별한 사과 방식!"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"(이상한 춤을 춘 후) 우리의 신은 나에게 그렇게 말했어. 우리가 있는 곳이 정확하다고. 나중에 한 귀인을 만날 거라고......"],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"정말 그런가요? 참 좋은 소식이네요! 우리 언제 그 귀인을 만날 수 있을까요?"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"너희들이 나를 잠에서 깨웠느냐?!"],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"......누구세요?"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"나는 대 드루이드이며 음유시인의 원조, 폭풍의 정복자, 모험자의 수호신, 신의 형 집행관 겸 사절, 공평한 대법관, 위대한 성악가, 메이진이라고 해!"],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"음...... 만나서 반갑습니다. 우리는 새로 들어온 사람이고 아까 그런 얘기를 들었는데......"],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"뭐라고? 너희들이 외래 침략자들이라고?! 너희들한테 우리들의 고향과 가족을 해치게 할 수 없어!"],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"네? 아니에요! 우리는 침략자가 아니에요! 우리는 그냥 쉴 곳을 찾고 있어요. 그리고 저희 고향에서 발생된 미스터리한 사건도 해결할 겸......"],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"안돼! 다리! 당신 무슨 짓을 했는지 알기나 해! 신께서 분노하실 거야! 잠깐만...... 누구라고? 메이진? 대 드루이드 메이진? 전설 속 그 사람 말인가요?"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"너희들...... 침략자가 아니라고? 그럼 누구니? 여기서 뭐해? 잠깐만...... 난 여기서 뭐 하는 거지? 여기는 어디지? 내 백성들은 어디 있지? 난 이곳에 대해 아무 기억이 없는 것 같은데......"],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"죄송하지만 우리도 이런 질문을 대답해 줄 수 없어요. 우리는 고향의 미스터리한 사건을 해결해 줄 수 있는 사람을 찾기 위해 생명의 위험을 무릅쓰고 먼 곳에서 왔거든요. 짙은 안개가 저희 고향에 뒤덮이더니, 그다음......"],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"작년 한 해 동안 발생한 홍수는 과거 10년 동안의 것보다 더 많았더라고요. 근데 가장 이상한 것은, 우리 종족들이 하나같이 생명 없는 토템으로 변했다는 거고요. 믿을 수 있나요?"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"앗...... 정보가 좀 많네. 미안해, 아까 너무 경솔했어. 그 파괴된 다리는 내가 도와줘서 다시 만들어 줄까?"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"메이진?! 위대한 메이진?! 너의 두루마기, 너의 비바람을 부르는 능력...... 진짜 존재하네요! 그럼 우리 가족의 장서 안의 모든 전설들이 다 존재하네요!"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"일꾼들아, 정신 차려서 다시 다리를 건설하라!"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"그런데 우리 다쳤어요! 지금은 일을 못하겠어요!"],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"난 너희들이 필요한 것을 알고 있어. 긴 여정에서 난 약초에 관한 많은 지식을 배웠어. 너희들에게 사과하기 위해 우리는 약초를 좀 수집하고 여기서 <color=#f58c26>약초밭</color>을 건설하자."],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"고마워요! 정말 너그럽네요! 이따 정원에 돌아가서 배워온 새 지식을 통해 토템 속에 갇히는 백성들을 구하겠어요! 너무 좋네요, 출발!"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"우리는 새 조력자를 찾아와 같이 돌아왔어요! 어서 이 <color=#f58c26>소형 약초밭</color>을 건설하세요!"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"와우, 너 건축기술 나쁘지 않은데! 이 소형 약초밭 정말 예쁘다!"],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"그리고 매우 유용하죠! 현재 노동자들의 부상을 모두 치료했으니, 우리는 곧 다리 건설을 진행할 수 있을 거예요!"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"도움을 줄 수 있어서 참 기쁘군."],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"방금까지만 해도 제사장님은 메이진 님의 미덕과 해박한 지식을 칭찬하고 계셨어요. 제가 말씀드리려는 건......"],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"메이진 님처럼 경험이 풍부한 모험가가 저희와 함께 한다면 저희에게는 큰 영광이죠. 하지만 당신은 전설이잖아요! 함부로 낯선 사람들과 함께하지 않는다는 건 잘 알고 있습니다! 제발 부탁이니 저희와 함께 해요! 가능할까요?"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"좋아. 내가 이곳에 파견된 이유가 이것 때문이 아닐까 싶군."],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"동의하지 않으실 줄 알았어요...... 잠깐만! 저희와 함께 하신다고요?! 맙소사, 믿을 수 없어...... 오늘은 내 생애 최고의 날인 것 같아요!"],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"죄송합니다, 저분은 가끔 흥분할 때가 있어요. 이제 저희와 합류했으니, 우리 오늘 메이진 님을 위한 환영 파티를 할까요?"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"괜찮네, 파티를 하지 않아도 좋네. 나는 급히 해야 할 일이 있어. 나무를 좀 찾아서 내가 망가뜨린 다리를 다시 세울 거야."],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"이 얼마나 훌륭한 사람인가! 오! 그와 만난 것만으로도...... 내 생애 최고의 날이야!"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"그쪽이..... 추장인가 보군, 맞나? 방금 큰 도움이 됐어, 고마워. 지금 우리는 다리를 건설할 준비가 다 되었네."],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"마치 새것과 같네요! 이제 엔다 제사장님, 신과 다시 이야기할 준비가 되셨나요?"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"여태껏 이 정도로 준비가 잘 된 적은 없었어!"],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"좋아요! 추장님, 이제 제사장님과 그녀가 애지중지하는 제단이 다시 만나게 되었으니, 우리도 슬슬 일을 시작..…."],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"아야! 넘어질 뻔했잖아! 헐, <color=#f58c26>제단</color>에서 <color=#38c0a5>원석</color>이 떨어졌잖아. 너희들은 일하는 게 정말 신중하지 못해."],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"아하! 알겠어요! 일단 우리는 각종 자원을 저장하는 <color=#f58c26>창고</color>를 지어야 해요. 이렇게 하면 바닥에 흩어져 있는 각종 물건에 걸려 넘어지지 않을 거예요."],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"물건은 다 준비되었습니까? 그럼 우리 신나게 놀아봐요! 미안해요, 제 말은 <color=#f58c26>창고</color>를 짓자는 말이에요."],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"튼튼한 벽, 넓고 밝은 실내 공간...... 추장님의 건축기술은 날로 정교해지는 것 같네요!"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"앗, 대장님? 대장님 뒤에 다리가 여덟 개가 달린 뭔가가 있어요."],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"뭐?! 무슨?! 이게 뭐야?! 일종의 물에서 사는 동물의 시체 같은데...... 음, 피부가 매끄럽고 탄력이 있어."],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<color=#f58c26>크라켄</color>이다! 이건 <color=#f58c26>크라켄</color>이야!! 내가 책에서 읽은 적이 있어. 이것은 틀림없이 그 괴물의 새끼야! 그런데 왜 이곳에 <color=#f58c26>크라켄</color>이 있는 거야?!"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"두려워할 것 없어. 저건 이미 죽은 거야, 그리고 고작 <color=#f58c26>문어</color> 한 마리에 뭘 그렇게 놀라나."],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"문어요? 처음 들어보는 동물이네요......"],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"처음 듣는다는 걸 보니, 자네들은 내륙에서 왔나 보군. 우리 민족은 바다의 민족이야. 우리는 바다 덕분에 먹고 사네. 그렇기에 문어는 우리에게 밤하늘의 별처럼 흔한 것이네."],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"사실... 따라오게, 일단 먼저 밧줄과 나뭇가지를 찾도록 하지. 그다음 내가 자네들에게 어떻게 문어 가죽으로 텐트를 치는지 알려주겠네."],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"......그리고...... 이렇게 하면 완성! 내가 상상했던 모습과는 많이 다르군."],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"정... 정말... 귀엽군요!"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"미안하군, 난 실천보다는 이론에 능한 편이라. 건축은... 내 전문분야가 아니네. 난 일단 좀 휴식해야겠네......."],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"오, 위대한 메이진 님! 저희 텐트에 와서 휴식을 취하지 그러세요? 메이진 님께서 저한테 많은 지식을 전해주셨으니 저는 메이진 님의 영원한 사자가 될 겁니다."],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"제사장님에게 있어 이건 꿈을 이루었다고 볼 수 있겠네요. 두 사람의 관계가 좋아지는 건 저도 기쁘긴 한데 무언가 좀 이상하지 않나요? 추장님?"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"부족 어르신들의 얘기로는 바다를 찾으러 간 사람들은 아무도 돌아오지 못했다고 했잖아요. 아, 한 명이 있네요. 돌아온 후 미쳐서 종일 세계의 끝에는 물로 만들어진 높은 벽이 있다고 중얼거리던 그 사람 말이에요."],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"하지만 메이진 님이 말하길 자기들은 바다의 민족이라고 했잖아요! 바다에 어떻게 사람이 살아요!"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"이 부분이 제가 수상하다고 생각하는 부분이에요. 그러나 아직까지는 그가 우리에게 해를 끼치지 않았으니, 그는 신경 쓰지 말고 본인이 맡은 일을 완수하도록 해."],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"우리는 지금껏 아주 넓은 지역을 탐사했습니다. 그리고 저희가 얻은 대량의 전리품은 이미 영지를 가득 채우고 있어요. 가축은 이것들을 저희의 고향으로 운송할 때 도움이 될 겁니다. 하여 가축들에게 <color=#f58c26>외양간</color>을 지어주도록 하세요."],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"괜찮네요, 추장님! 조만간 이것들을 써먹을 수 있을 것 같네요. 이 도구들은 조만간 쓸모가 있을 것 같아요. 멋집니다."],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"저희 건설 작업은 곧 마무리될 것 같아요. 그런데 한 가지 도움이 필요해요."],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"영지를 떠난 뒤에 혹시 모를 불상사가 있을지도 모르니까, 주변을 순찰시킬 수 있는 전문적인 정찰대가 필요해요."],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"저희는 그들을 위해서 <color=#f58c26>훈련소</color>를 지어야 합니다!"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"맞아 케빈, <color=#f58c26>훈련소</color>를 건설할 재료를 찾으러 가자!"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1080101","TextValue"=>"준비됐나?"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1080102","TextValue"=>"준비됐습니다. 대장님!"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1080103","TextValue"=>"추장님께서 재료 준비 다 하셨어. 잠시 뒤에 작업 시작하자!"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1080104","TextValue"=>"알겠습니다, 대장님!"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1080201","TextValue"=>"잘했어! 그리고 이제 우리...... 제사장님? 뭐가 잘못됐나요?"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1080301","TextValue"=>"대 드루이드 메이진 님과 이야기를 나누다, 너무 피곤해서 잠에 들었는데 같은 꿈을 꿨어 그리고 꿈에서 한 여신이 "<color=#f58c26>바다의 심장</color>을 구해주세요..…."라고 말했어."],
13690=>["Value"=>13690,"TextKey"=>"剧情ID1080302","TextValue"=>"<color=#f58c26>바다의 심장</color>이요? 그게 뭔가요?"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID1080303","TextValue"=>"우리 민족에는 한 전설이 있다네, 깊은 바닷속에 꿈에서 나온 그 어린 여신님이 가호하고 있는 거대한 기포가 있고, 그 기포 속에는 고대 동물뿐만이 아니라 거인과 요정도 함께 살고 있다는군. 하지만 이것은 단지 어린아이를 재우기 위한 이야기에 불과하네."],
13692=>["Value"=>13692,"TextKey"=>"剧情ID1080304","TextValue"=>"저는 이 일을 반드시 연구하고 밝혀내야 합니다. 여신님의 메시지를 잘 듣기 위해서 <color=#f58c26>강력한 룬의 받침대</color>가 필요합니다."],
13693=>["Value"=>13693,"TextKey"=>"剧情ID1080305","TextValue"=>"알겠습니다! 추장님, 저희 원석을 좀 찾아와서, 엔다에게 받침대를 지어주세요!"],
13694=>["Value"=>13694,"TextKey"=>"剧情ID1090101","TextValue"=>"곧 작업이 끝납니다, 축하할 시간이에요!"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID1090102","TextValue"=>"대단해요!"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID1090201","TextValue"=>"아직 축하하지 마! 너희들이 이렇게 떠들어 대는 바람에 도무지 집중을 할 수가 없잖아!"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID1090202","TextValue"=>"신과 연결을 시도하고 있었는데, 너희 같은 애송이들 때문에 망했어!"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID1090203","TextValue"=>"너희들 입 다물고 내 일을 방해하지 마!"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID1090204","TextValue"=>"어휴, 보아하니 누군가 기분이 안 좋아 보이네요."],
13700=>["Value"=>13700,"TextKey"=>"剧情ID1090205","TextValue"=>"잠깐! 조용히 해! 그녀의 목소리가 들릴 것 같아. 이건 매우 중요한 일이라고."],
13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"음... 잘 안 들리네... 하지만 추측하건대, 그녀는 우리가 북쪽으로 가야 한다고 말했어, 그곳은 날짐승뿐만 아니라, 풀 한 포기도 자라지 않아. 그곳에서 우리는 친구를 한 명 찾을 수 있어."],
13702=>["Value"=>13702,"TextKey"=>"剧情ID1090207","TextValue"=>"그래요, 들어보니…불가능한 것도 아니지요? 제 말은, 설마 무슨 일이 일어나겠어요? 그럼 북쪽으로 떠나요!"],
13703=>["Value"=>13703,"TextKey"=>"剧情ID1090208","TextValue"=>"하지만 그전에, 마침내 우리의 새 영지의 건설을 축하할 수 있어요! 모두들 모이세요, 우리 모두 성대한 파티를 열어요!"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID1090209","TextValue"=>"만세!"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID1090301","TextValue"=>"이제 집을 떠나면 다시는 못 돌아올 수도 있어요. 하지만 우리는 이 불가사의한 섬을 찾았습니다, 새로운 친구를 사귀게 되었고, 심지어 우리 곁을 떠난 부족원을 부활시키는 방법까지 찾아냈어요!"],
13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"이 모든 것들을, 저희의 여신님에게 감사해야 해요. 그녀는 줄곧 우리를 비호하고 우리의 방향을 인도해 주었어요. 이어서 저는 우리의 새 친구, 사랑하는 메이진 님에게 감사하고 싶어요, 그는 사심 없이 저희에게 그의 그 해박한 지식을 전수해 주었어요."],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"그러나 가장 중요한 것은 추장님, 저번처럼 강인하고 우호적이었기 때문에, 저희는 이 모든 것들을 다 해낼 수 있었어요. 그래서 당신이 우리를 위해 해 준 모든 것에 감사드립니다. 어... 제사장님, 울고 계신가요?"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"아... 아니야... *코 훌쩍거린 거야* 안 울어! 그냥...*코 훌쩍인 거*가지고.... 그래! 나 울고 있어! 이제 맘에 들어?! 사랑해요 추장님! 당신은 최고의 추장님이에요!"],
13709=>["Value"=>13709,"TextKey"=>"剧情ID1090305","TextValue"=>"하하, 이 정도면 문제를 설명하기에 충분하다고 생각해요. 앞으로의 여정이 어떻게 될지 기대되네요. 언젠가 저희 고향의 미스터리를 풀고 꼭 다시 집을 지을 거예요."],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2010101","TextValue"=>"조급해 하지 마, 남자애들이란, 우리 곧 도착할 거야....."],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2010102","TextValue"=>"신의 가호가 함께 하기를! 저희가 사막에서 며칠이나 걸었는데, 혹시 물 좀 주실 수 있나요?"],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2010103","TextValue"=>"참어! 내가 네 나이였을 때.... 야... 이게 뭐야?"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2010201","TextValue"=>"으아아아아아아아아아악!"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2010202","TextValue"=>"제사장님?"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2010203","TextValue"=>"안돼, 제사장님 아래에 계십니까? 괜찮으세요?"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2010204","TextValue"=>"응... 난 아직 살아있어... 음, 내 생각에는... 이 마법 광산에 빨려 들어온 것 같아."],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2010205","TextValue"=>"오, 신이시여 감사합니다. 괜찮으세요. 안심하세요, 저희가 최선을 다해서 최대한 빨리 당신을 구해겠습니다."],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2010301","TextValue"=>"추장님, 근처 언덕 꼭대기에서 버려진 건물을 발견했어요. 내부에 쓰레기통에 묻혀있는 거대한 도르래가 보였어요."],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2010302","TextValue"=>"제 생각엔 <color=#f58c26>오래된 작업장</color> 같아요."],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2010303","TextValue"=>"혹시 저희가 문을 열어서 안쪽을 청소하고, 밧줄과 도르래를 만들어서 제사장님을 끌어올릴 수 있을까요?"],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2010304","TextValue"=>"잡담하지 말고, 빨리 가서 그 도르래 좀 만들어봐!"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2010305","TextValue"=>"걱정 마세요, 제사장님. 날도 어두워지고 있고 밖에 있으면 얼어 죽을 거예요. 그래서 저는 <color=#f58c26>텐트</color>를 만들어서 다 같이 휴식을 취하면서 해결책을 찾아볼게요."],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2010306","TextValue"=>"그럼 나는 어떡해?! 얼어 죽을 수도 있다고!"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2010307","TextValue"=>"걱정 마세요, 이곳의 지상은 낮과 밤의 온도차는 크지만, 지하의 온도는 아늑하고 온도도 일정해요. 그러니까 조금만 버텨주세요, 제사장님!"],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2020101","TextValue"=>"다음날......"],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2020201","TextValue"=>"여기 잠자리가 정말 편안했어요! 저의 제사장님, 아래는 어떠신가요?"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2020202","TextValue"=>"나한테 어떻냐고 물을 시간에, 빨리 가서 나를 여기서 꺼낼 수 있는 방법을 생각해내!"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2020203","TextValue"=>"저희도 계속 생각하고 있어요, 산 정상에 있는 작업장의 문을 여는 데 필요한 도구가 필요해요. 걱정 마세요, 알겠죠? *미소*"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2020204","TextValue"=>"너 내가 올라가면 보자... 이 거만한 꼬맹이 같으니..."],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2020205","TextValue"=>"아아, 너무 아파요! 이런 제 친절을 어떻게 오해할 수 있니요! 그렇지만 저는 당신을 용서할게요. 추장님과 저 곧 돌아올게요!"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030201","TextValue"=>"좋았어, 저희 들어왔어요! 지금 저희 필요한 게..."],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030202","TextValue"=>"대장님, 조심하세요! 대장님 뒤!"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030203","TextValue"=>"아! 이 화살 어디서 날아온 거야?!"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030204","TextValue"=>"나와!"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030205","TextValue"=>"거기 누구세요?"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030206","TextValue"=>"나와! 납치범!"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2030207","TextValue"=>"납치범이요? 잘못 짚으신 거 같아요, 여사님... 아야 아파요! 아프다고요!"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"목소리 여사님, 저희 나왔어요. 저에게 어떤 상황인지 설명해 줄래요?"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2030302","TextValue"=>"먼저, 나는 소리 여사가 아니야, 나는 트라치카, 번개의 사냥꾼, 모로스의 딸, 대지의 어머니, 여자 영웅이라고..."],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2030303","TextValue"=>"위대한 트라치카!!!!!"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2030304","TextValue"=>"뭐... 이 소리가 어디서 나는 거지... 산기슭에서? 누군가 그 광산에 빠졌나요?"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"너희 셋, 내가 돌아올 때까지 여기서 꼼짝 말고 있어! 만약 너희들 한 발짝이라도 움직이면, 무슨 일이 일어날지 알고 알겠지."],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2030306","TextValue"=>"알겠어요, 여사님. 한 발자국도 움직이지 않을게요!"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2030401","TextValue"=>"너 거기 있구나. 사제? 너 이 밑에서 뭐하고 있어? 사람을 찾다가 이 광산을 열었는데 당신이 왜 이 안에 있어?"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"할 말이 많은데 간단히 말씀드릴게요. 제가 저기 당신이 잡은 남자애들이랑 같이 왔는데 제가 이 광산에 빠져 버렸지 뭐예요. 그런데 그건 중요하지 않아요. 당신을 만났으니까요!! 제가 예언했어요 우리가 이 거친 땅에서 우리를 도울 수 있는 친구를 만날 거라고, 당신일 줄은 생각지도 못했어요!!"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2030403","TextValue"=>"친구? 너희를 도와줘? 뭐를? 너네... 납치범 아니야?"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"납치범요? 아니, 아니에요, 저희는 여행 중에 우리 고향을 구원할 수 있는 조력자를 찾으려고 지나가다가... * 설명 *"],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2030405","TextValue"=>"하하. 네가 이렇게 말하니까, 엄마가 너희 같은 애들을 만날 거라고 했었어... 그러고는 엄마가 사라졌지. 아무튼 확실한 건 내가 사람을 잘못 잡은 거군."],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2030406","TextValue"=>"엄마?"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2030407","TextValue"=>"상관하지 마, 별로 큰일은 아니니까. 보아하니 당신의 그 남자 애들이 그 도르래를 고쳐서 당신을 꺼내려고 하다가, 내가 설치해놓은 함정에 빠진 거군."],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2030408","TextValue"=>"네, 지혜로운 여사님 말이 맞아요. 그래서 제 모습이 이 모양이죠. 한 쪽 발만 움직일 수 있어요."],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2030409","TextValue"=>"어머나, 미안해요, 내 잘못이에요. 제가 잠시 후에 당신의 상처를 치료해 줄게요. 지금은 먼저 당신들을 도와 함정을 제거하고, 그 도르래를 수리해야겠어요..."],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2030501","TextValue"=>"도르래 수리 다 했어요, 대단해요 여사님!"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2030592","TextValue"=>"하나도 안 좋아! 빨리 올려줘! 지금 당장!"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2030683","TextValue"=>"이제 한 발자국 남았어요. 우리가 도르래를 만들어야 당신을 올릴 수 있어요."],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2030774","TextValue"=>"네가 날 노리고 있는 것 같아... *울음*"],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2040101","TextValue"=>"추장님, 당신은 이미 모든 자료를 다 수집하지 않았나요? 사실 조금 늦어도 상관없어요. 지금 엔다 제사장님이 여기에 없으니까, 마침내 한동안은 홀가분하겠네요..."],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2040102","TextValue"=>"네가 하는 말 다 들린다! 격식을 차려라!"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2040103","TextValue"=>"아차! 들리는 줄 몰랐는데… 아하! 도르래 준비됐어요!"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2040201","TextValue"=>"사랑하는 제사장님, 구조대는 이미 내려갔습니다, 충돌사고가 날 수도 있으니 잘 보이는 곳에 서주세요."],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2040202","TextValue"=>"네가 내 허리를 밟았어! 내 위에서 내려와!"],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2040203","TextValue"=>"제사장님이 곧 올라올 것 같아요. 감사합니다, 여사님."],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2040204","TextValue"=>"여사님이라고 부르지 마세요, 제 이름은 트라치카예요. 아까 어디 다쳤는지 보여주실래요?"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2040205","TextValue"=>"여기 종아리 쪽이에요, 여사님, 아.. 아니, 트라치카님."],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2040206","TextValue"=>"알겠어요. 저희 같은 사냥꾼들은 상처를 잘 돌본다고요. 광산의 구멍 밑에 잎사귀를 모아 뒀어요, 광산을 저장실로 삼았죠. 잎사귀 뽑아서 그 즙을 당신의 종아리에다~"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2040207","TextValue"=>"어... 종아리에... 좋아요. 그럼 이제 광산 안으로 내려가 볼까요?"],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2040208","TextValue"=>"아니, 아니, 당신 같은 초보자들은 횃불이 있어야 잘 보일 거예요. 저 아래는 당신들 생각보다 훨씬 깊다고요. 횃불과 발굴 도구를 찾아서 오세요!"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2050101","TextValue"=>"이거 가져가세요, 만약에 불이 꺼지면 멈추고 다시 돌아오세요? 알겠죠?"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2050102","TextValue"=>"준비됐나요? 출발할게요! 발밑을 조심하세요!"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2050103","TextValue"=>"네 여사님!"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2050104","TextValue"=>"추장님, 저와 제사장님을 여기에 남게 해주셔서 매우 감사합니다. 트라치카 님은 저 이 상태로는 들어갈 수 없다고 하셨어요. 정말 죄송합니다. 하지만 그들이 저희에게 가져올 새로운 발견이 기대돼요!"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2050105","TextValue"=>"위대한 트라치카 님 당신을 트라치카라고 부를 수 있다는 것이 정말 믿기지 않아요. 이 얼마나 영광스러운 일인가요! 그리고 당신은 조금도 감격스럽지 않나요... "],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2050201","TextValue"=>"나의 여신님이시여, 저것은 무엇입니까?"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2050202","TextValue"=>"지하 하천입니다! 저희 팀이 예기치 않게 <color=#f58c26>지하 하천</color>을 발견했어요! 물이 생겼다고요!"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2050203","TextValue"=>"흠뻑 젖었다고요."],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2050204","TextValue"=>"당신들 이런 나약한 태도는 좀 참으세요! 그냥 물이라고요!"],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2050205","TextValue"=>"이보세요, 저기, 추장, 당신 물이 있으니까. 그걸로 우리 <color=#f58c26>다육식물</color>을 심어요! 잎사귀 하나라도 잘 보살피면 금방 예쁜 다육식물이 될 거예요!"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2050206","TextValue"=>"이 아가씨들을 당신에게 보낼게요. 가서 물통과 삽 그리고 비료를 구해 오라고 하세요. 저는 여기서 기다리고 있을게요."],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2060101","TextValue"=>"됐어요 됐어! 얼마나 귀여운지 보세요! 잎사귀 좀 떼어 주세요, 큰 걸로요."],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2060102","TextValue"=>"저는 이런 식물을 본 적이 없어요… 뭐라고요? 잎사귀 하나 떼어달라고요?"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2060103","TextValue"=>"네, 잎사귀 하나 떼어서, 즙을 짜주세요, 그리고 그것을 다친 곳에 바르세요."],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2060104","TextValue"=>"알겠어요... 하나 떼어서... 바르고... 와 진짜 좋은데요! 이렇게 빨리 상처를 치료할 수 있는 약초는 들어 본 적 없어요!"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"글쎄요, 대지의 어머니가 괜히 그렇게 불리는 게 아니에요. 사람들이 저의 훌륭한 원예 기술 때문에 이 별명을 준 것 같아요. 이것들은 보통의 다육식물이 아니라 제가 키운 거라고요."],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2060106","TextValue"=>"기적의 창조자시여! 어머! 이제 저희 집 정원의 수수께끼가 곧 풀릴 것 같아요!"],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2060107","TextValue"=>"솔직히 말해서 그 일에 대해서는. 지금 기진맥진해서 급하게 수면이 필요해요. 그 집 정원에서 낮잠 좀 자도 될까요? 기지 같은 건가요? 침대는 있나요?"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2060108","TextValue"=>"네, 기지 같은 거예요, 그리고 이건 돌아갈 수 있는 지도예요. 그런데... 당신은 하룻밤 지내고 바로 가시는 건가요? 아니면 저희 팀에 들어오시는 건가요?"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2060109","TextValue"=>"당연히 당신들의 팀에 들어가야죠, 바보예요?! 당신들은 도움이 필요해요, 저도 지금 바쁘지 않고요, 같이 가지 않을 이유가 없잖아요? 어쨌든 우리는 같은 사람을 찾고 있잖아요. 그러니까! 지도는 내가 가져갈게요, 안녕!"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2060201","TextValue"=>"그리고 그녀는 갔어요. 우리들과 좋은 친구가 될 것 같아요. 저희가 하던 일을 계속해서, 영지 건설을 마무리해요. 저번 영지처럼 자원을 저장할 수 있는 <color=#f58c26>창고</color>가 필요해요."],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2060202","TextValue"=>"<color=#f58c26>창고</color>를 지을 자원을 수집해 주세요!"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2070101","TextValue"=>"대단해요!"],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2070102","TextValue"=>"너는 내가 너네들의 수원을 찾아 준 것에 대해 아직 감사하지 않았어! 내가 말했지, 내 느낌이 맞았다고!"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2070103","TextValue"=>"네, 좋아요. 저는 앞으로 당신의 점을 믿고 모든 무리한 요구를 들어줄게요. 다음은 무엇이 필요한가요?"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2070104","TextValue"=>"너...! 됐어. 다시 신과 교감해서 앞으로 나아갈 방향을 정해야 해. 이번에는 <color=#f58c26>전망대</color>가 필요해. 천문학으로 점을 봐야 할 것 같아."],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2070105","TextValue"=>"왜 천문학을 선택했습니까? 심지어 저희는 그 별들이 무엇인지도 모른다고요. 제 말 뜻은, 저것들은 단지 하늘의 작은 점들 뿐이라고요!"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2070106","TextValue"=>"더 이상 낭비할 시간이 없어! 해야 할 일이 잔뜩 있다고! 더 이상 헛소리하지 마!"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2070107","TextValue"=>"가서 내가 말한 것들을 찾아와. 빨리!"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2070108","TextValue"=>"알겠어요..."],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2070201","TextValue"=>"어른들이 고집불통 노인은 자극하지 말라고 하던데, 어떻게 안 듣겠어요..."],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2080101","TextValue"=>"추장님, 이제 당신이 해야 할 일을 끝내시고, 이제 남은 것은 제사장님이 지어달라고 하신 <color=#f58c26>전망탑</color>이에요."],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2080102","TextValue"=>"나도 듣고 있어 이놈아! 불평 그만하고 일이나 해!"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2080103","TextValue"=>"네~ 알겠다고요~ *한숨*"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2080201","TextValue"=>"그럼 추장님, 저는 신과 얘기 나누러 가겠습니다."],
13803=>["Value"=>13803,"TextKey"=>"剧情ID2080202","TextValue"=>"쉬고 계세요, 잠시 후 뵙겠습니다."],
13804=>["Value"=>13804,"TextKey"=>"剧情ID2080203","TextValue"=>"*작은 소리* 여기요 여기, 추장님..."],
13805=>["Value"=>13805,"TextKey"=>"剧情ID2080204","TextValue"=>"엔다님이 드디어 멈추셨네요."],
13806=>["Value"=>13806,"TextKey"=>"剧情ID2080205","TextValue"=>"우리 팀원들이 광산 아래에서 한 무더기의 금을 찾았어요."],
13807=>["Value"=>13807,"TextKey"=>"剧情ID2080206","TextValue"=>"우리가 그것들을 운반할 상자를 만들기 위해서는 당신의 도움을 필요해요."],
13808=>["Value"=>13808,"TextKey"=>"剧情ID2080207","TextValue"=>"상자 재료 수집하는 것을 도와주시겠어요?"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID2090101","TextValue"=>"휴, 금 너무 많아."],
13810=>["Value"=>13810,"TextKey"=>"剧情ID2090102","TextValue"=>"이게 뭐야? 빛이 나는데..."],
13811=>["Value"=>13811,"TextKey"=>"剧情ID2090201","TextValue"=>"작은 가방인데... 여기 위에 "나를 먹어"라고 적혀 있어요. 안에는... <color=#f58c26>빛나는 씨앗</color>? 이 씨앗을 먹으라는 뜻인가요?"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID2090202","TextValue"=>"내려놔!"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID2090203","TextValue"=>"뭐라고요?! 제사장님, 뭐 하시는 거예요!"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID2090301","TextValue"=>"방금 그거 먹었어요?! 저희는 아직 그게 뭔지도 확실하게 모른다고요!"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID2090302","TextValue"=>"별은 나를 <color=#f58c26>동남쪽</color>에 위치한 <color=#f58c26>대협곡</color>으로 안내하고, 이 <color=#f58c26>최면 씨앗</color>은 나를 도와...... 만날 수 있도록 도와줄 거야. *코를 골다*"],
13816=>["Value"=>13816,"TextKey"=>"剧情ID2090303","TextValue"=>"제사장님? 제사장님? 계신가요?"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID2090304","TextValue"=>"*코를 골다*"],
13818=>["Value"=>13818,"TextKey"=>"剧情ID2090305","TextValue"=>"그리고 그녀는 잠이 들었어요. 저는 정말 이런 영적인 사람들은 잘 모르겠어요. 그들은 가끔씩 이상해요."],
13819=>["Value"=>13819,"TextKey"=>"剧情ID2090306","TextValue"=>"아, 제사장님이 기절했으니, 저희 다음은 어디로 가야 하나요?"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID2090307","TextValue"=>"그녀가 <color=#f58c26>대협곡</color>이라고 했죠? <color=#f58c26>동남쪽</color>으로 갈까?"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID2090308","TextValue"=>"그녀를 믿어도 될까요? 지금 보기에 그녀는... 좀 정상이 아닌 것 같아요?"],
13822=>["Value"=>13822,"TextKey"=>"剧情ID2090309","TextValue"=>"물론이지. 나는 앞으로 그녀를 믿을 것이라고 약속했어. 게다가 우리 거기 말고 또 있어? 오늘은 우선 휴식을 취한 후에 내일 동남쪽으로 출발하자."],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3010101","TextValue"=>"저기. 거기 이봐."],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3010102","TextValue"=>"응?"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3010103","TextValue"=>"그래! 너. 늙은 노인네 좀 거들어 주겠나?"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3010104","TextValue"=>"음... 사실 저는 여기 없어요."],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3010105","TextValue"=>"뭐라고? 왜?"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3010106","TextValue"=>"저는 저의 부족원들과 함께 있어요. 우리 정원의 수수께끼를 풀 수 있는 조력자를 찾아다니고 있어요."],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3010107","TextValue"=>"알아. 사실 너한테 말하는 거야, 손에 빛나는 네모난 것을 들고 있는 너?"],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3010108","TextValue"=>"제 <color=#f58c26>핸드폰</color>을 말씀하시는 건가요?"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3010109","TextValue"=>"그래, 그거 <color=#f58c26>"너의 핸드폰"</color>. 나 좀 도와주겠나?"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3010110","TextValue"=>"잠시만... 어떻게 저를 볼 수 있는 거죠?"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3010111","TextValue"=>"오 자기야, 나는 비록 장님이지만 모든 것을 느낄 수 있다네. 너라면 이해할 수 있을 거야. 이제 나를 좀 도와주겠나?"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3010112","TextValue"=>"좋아요. 뭐가 필요하세요?"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3010113","TextValue"=>"당신 부족사람들이 이곳을 지나가겠지? 그럼 나는 굶주린 사람처럼 분장하여 <color=#f58c26>노점</color>을 차린 후, 내 쓸모없는 잡동사니들을 팔아야 겠군. 맙소사! 나는 정말 천재야!"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3010114","TextValue"=>"뭐라고 하시는지..."],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3010115","TextValue"=>"나는 아무렇게나 무식한 사람들을 막 도와주고 싶지 않다네, 그렇지? 나는 좋은 사람만 돕는다네. "],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3010116","TextValue"=>"그래서요?"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3010117","TextValue"=>"그러니 만약에 그들이 내 물건을 사서 음식을 주면 그걸로 된 거야. 혹은 직접 음식을 해 준다거나!"],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3010118","TextValue"=>"그렇지 않는다면, 미안하게 되었네, 내가 손가락을 튕겨서, 네 부족들을 사라지게 할 거야. 알겠나? 그러니, 빨리 스테이지에 들어가서 재료를 수집해 와!"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020101","TextValue"=>"아름답군! 고맙네!"],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020102","TextValue"=>"내 딸도 너처럼 믿음직스럽고 손발이 빠르면 좋은 텐데."],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020103","TextValue"=>"우리는 사막에서 헤매다가 길을 잃었다네... 내가 방향 감각이 그리 좋지 않아서 말이야."],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020104","TextValue"=>"당신은 그녀가 지금 어디에 있는지 아시나요?"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3020105","TextValue"=>"당연히 알지! 하지만 그녀가 나를 찾으러 올 수도 있잖아!"],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3020201","TextValue"=>"제 얘기는요, 적어도 번개는 날려줘야죠!"],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3020301","TextValue"=>"그렇게 하면 좋기는 한데, 알고 있나? 자네와 나, 느긋하게 얘기 좀 하고..."],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3020302","TextValue"=>"그들은 곧 온다네. 우리는 그냥 조금 기다리면 된다네."],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3020303","TextValue"=>"한참 후"],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3020304","TextValue"=>"나는 저기 뼈 더미에 올라가서 그들이 어디까지 왔는지 살펴봐야겠네."],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3020401","TextValue"=>"하, 그들이 저기 있네! 그 제사장 정말 잘생겼군!"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3020402","TextValue"=>"잠깐! 그들을 본 것 같네."],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3020501","TextValue"=>"와, 네 그 제사장 정말 잘생겼군!"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3020502","TextValue"=>"오! 오! 저게 자네인가? 호랑이 이빨로 만든 목걸이를 차고 있는? 나쁘지 않군. 강력한 작은 추장!"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3020601","TextValue"=>"조금 후"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3020701","TextValue"=>""배고파 죽겠어요, 물건 좀 사주시고, 먹을 것 좀 주세요." 음... 여기 작은 노점이 있어요."],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3020702","TextValue"=>"아, 추장님, 오셨나요. 제사장님이 꿈에서 어떤 사람이 용의 뼈에서 만나자고 했대요."],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3020703","TextValue"=>"역시 여기에 누군가 있었던 흔적이 있어요. 하지만 이 불더미 열기가 이미 식었어요, 사방에는 사람 그림자도 안 보이고요... 설마 저희 바람맞은 건가요?"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3020704","TextValue"=>"어쨌든, 그럼 저희 여기에 임시 거처를 만들어서 제사장님이 말씀하신 그 사람을 기다리면서 조금 쉬고 있을까요! "],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3020801","TextValue"=>"힘들어 죽겠네, 드디어 도착했구나... 이렇게 햇볕이 내리쬐는데 망토에 싸여있다니, 이 늙은 내 뼈가 다 익겠다! 어서 이 망토를 치워버려!"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3020802","TextValue"=>"존경하는 제사장님, 아까 낙타 등에서 푹 잤으면서 피곤해 죽겠다니요."],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3020803","TextValue"=>"그리고 망토는 벗으면 안 돼요. 고비 사막은 낮에는 덥지만 밤에는 유난히 춥다고요."],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3020804","TextValue"=>"신이시여... 왜 저를 이런 곳으로 인도하시는지요... 이 오만한 젊은이 때문에도 이렇게 힘이 드는데..."],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3020805","TextValue"=>"조금만 더 참아 주세요. 추장님께서 저희를 도와 최대한 빨리 <color=#f58c26>텐트</color>를 지을 재료를 모을 거예요."],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3030101","TextValue"=>"역시 추장님이세요. 이렇게 빨리 자료를 다 모으다니, 바로 일 시작하겠습니다!"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3030201","TextValue"=>"너희들도 배가 고플 텐데, 모닥불을 빌려서 밥 먹고, 휴게소를 만들어서 잠깐 쉬어. 배불리 먹어야 힘을 내서 또 일을 하지!"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3030202","TextValue"=>"너무 좋아!!! 먹을 거! 베이컨이요!"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3030203","TextValue"=>"저는 양 갈비가 먹고 싶어요..."],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3030204","TextValue"=>"이 포악한 육식 동물 같으니라고!"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3030205","TextValue"=>"어떤 걸로 준비해드릴까요?"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3030206","TextValue"=>"나는 스테이크, 미디엄으로, 와사비 소스를 겯들여서, 고마워."],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3030207","TextValue"=>"제사장님, 그것도..."],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3030208","TextValue"=>"알고 있어! 입 다물어!"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3030209","TextValue"=>"하하, 여행을 다니는 사람들에게는 단백질의 보충이 중요해요. 이 길은 쉽지 않아요, 그렇기 때문에 우리는 좋은 음식을 먹어야 해요. 추장님, 어떻게 생각하세요?"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3030210","TextValue"=>"우리는 재료가 그렇게 많지 않아..."],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3030211","TextValue"=>"우리는 양고기, 말린 쇠고기 그리고 사과가 있어요, 추장님!"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3030212","TextValue"=>"하지만 추장님 말씀대로 우리는 앞으로 닥칠 극한의 날씨를 대비해야 해요. 그러면 다른 단백질 대체품을 찾아야 해요."],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3030213","TextValue"=>"길에서 몇몇 사막 도마뱀들을 보았어요. 도마뱀 알은 그 자체로도 훌륭한 단백질 공급원이에요!"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3030214","TextValue"=>"뭐라고?! 도마뱀?! 그거 먹을 수 있는 거야?!"],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3030215","TextValue"=>"이런 희귀한 재료는 작은 창의력 하나만으로도 진수성찬이 될 수 있어요! 예를 들면, 도마뱀 조림은 아주 맛있다고 들었어요!"],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3030216","TextValue"=>"저는 더 이상 못 기다려요!"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3030217","TextValue"=>"오... 도마뱀을 잡았어요..."],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3040101","TextValue"=>"훌륭해요! 재료를 다 모았으니 시작하자고요!"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3040102","TextValue"=>"갑니다! 모닥불을 피웠어요!"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3040201","TextValue"=>"드디어... 음식을... 못 움직이겠어... 오믈렛... 스테이크... 사과 구이..."],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3040202","TextValue"=>"아란의 양 갈비, 그리고 케빈의 오믈렛... 엔다 제사장님은 이 저와 함께 이 맛있는 도마뱀 조림을 먹어요..."],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3040301","TextValue"=>"아무도 너랑 도마뱀 조림을 먹지 않을 거야!"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3040302","TextValue"=>"그래요, 이 뜨거운 김이 나는 맛있는 조림은 새로운 친구들에게 줄게요."],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3040303","TextValue"=>"새 친구? 무슨 새 친구?"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3040401","TextValue"=>"아!!! 나의 신이시여!!! 이 쥐들을 제 몸에서 떨어뜨려 주소서!"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3040402","TextValue"=>"우선 그것들은 쥐가 아니에요. 쥐는 이렇게 크지 않아요. 제가 관찰한 바로는 고비사막 지역 특유의 생물, 모래쥐예요."],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3040403","TextValue"=>"둘째, 무리 지어 다니는 동물이고 겁이 많고 예민하기 때문에 몸집이 작지는 않아도 성격이 온화해서 사람에게 전혀 피해를 주지 않아요."],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3040404","TextValue"=>"알겠어, 알겠어, 알겠다고!!! 나는 이것들이 무엇인지 관심 없으니, 빨리 떼어내!"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3040405","TextValue"=>"음… 당신이 그렇게 말하다니 좀 이상하군요. 이 모래쥐들은 왜 당신을 전혀 무서워하지 않을까요? 혹시 사람에 의해 길러진 걸지도 몰라요."],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3040406","TextValue"=>"친애하는 노동자 여러분, 이 귀여운 놈들을 제사장님 몸에서 옮겨주실래요?"],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3040407","TextValue"=>"문제없습니다!"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3040501","TextValue"=>"헤이!!!! 돌려줘!!!"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3040502","TextValue"=>"그러고는 그냥 가버렸어요. 그것들은 제사장님 이외의 사람을 무서워하는 것 같은데요?"],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3040503","TextValue"=>"그것들이 내 반지 가져갔어! 내가 좋아하는 반지인데..."],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3040504","TextValue"=>"불쌍한 제사장님... 저희는 용의 뼈 쪽에 가면 안 될 것 같은데요? 어쨌든 저는 그 꼬마들에게 관심이 생겼어요."],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3040505","TextValue"=>"하지만 그곳은 지형이 험해서 <color=#f58c26>풍차</color>가 필요해요."],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3050101","TextValue"=>"차 재료는 준비 다 했나요? 좋아요! 그럼 소매를 걷고 건설을 시작하자고요!"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3050102","TextValue"=>"따끈따끈한 풍차가 곧 나옵니다!"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3050201","TextValue"=>"정말 멋진 풍차예요! 이렇게 하면 우리가 올라가고 내려올 때 더 안전하고 더 편할 거예요!"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3050202","TextValue"=>"좋아! 어서 내 반지를 찾아와! 그것은 매우 신성한 거라고!"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3050203","TextValue"=>"좋아! 출발하자! 케빈, 아란, 너희들 준비 다 됐나?"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3050204","TextValue"=>"항상 준비하고 있어!"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3050205","TextValue"=>"음... 대장님... 제가 겁이 많은 것은 아니지만 절벽에서 떨어질 때를 대비해 밧줄이 필요하다고 생각합니다..."],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3050206","TextValue"=>"아하! 그래 네 말이 정말 맞아, 안전은 항상 최우선이야! 그럼 추장님, 안전장구를 좀 더 구해주세요."],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060101","TextValue"=>"준비됐나?"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060102","TextValue"=>"준비됐습니다!"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060103","TextValue"=>"좋아! 지금 바로 그 모래쥐의 수수께끼를 풀러 가자! 정말 기대된다!"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060104","TextValue"=>"내 반지 잊지 말고!"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060201","TextValue"=>"우와, 이 뼈 더미는 정말 깊네요! 잠깐... 밑에 반짝거리는 게 있는데... 음... 이거 엔다 님의 반지가 아닐까요?"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060202","TextValue"=>"추장님! 저희가 뭘 찾았는지 보세요! 먼지투성이 노부인입니다!"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060203","TextValue"=>"그리고 제사장님의 반지도 있어요."],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060301","TextValue"=>"*눈물이 그렁그렁*아란아, 너무 고마워, 네가 저 무리들 중에서 가장 도리가 있구나... 잠시만... 이게 뭐야?"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060401","TextValue"=>"*흥분한 찍찍거리는 소리*"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060402","TextValue"=>"...고마워?"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3060403","TextValue"=>"*기뻐하는 찍찍 소리*"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3060501","TextValue"=>"*흥분한 찍찍거리는 소리*"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3060502","TextValue"=>"오! 안녕! 너희들 정말 열정적이잖아! 어디서 본 것 같은데? 이 모피 촉감이 익숙한 느낌인데..."],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3060503","TextValue"=>"오! 그리고 네가 아까 내가 꿈에서 봤던 바로 그 꼬마 제사장이구나! 현실에서 보니 더 귀여운데~"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3060504","TextValue"=>"꼬마? 네가 감히 나보고 꼬마라고?! 나는 존귀한 신의 사절..."],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3060505","TextValue"=>"죄송합니다만, 꿈에 저희 제사장님이 나오셨다고요?"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3060506","TextValue"=>"오~ 젊은이! 그래 맞아! 내가 꿈에서 이 꼬마 제사장을 봤어, 그리고 그녀에게 "여기서 기다릴게."라고 말했지. 근데 그게 뭔지 전혀 모르겠네 하하하하하하하!"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3060507","TextValue"=>"그게 대체 무슨 소리야?"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3060508","TextValue"=>"사실 너무 웃겨서, 내 이름이 전혀 기억나지 않아, 그래서 그 괴상한 꿈이 무슨 뜻인지 더더욱 모르겠네."],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3060509","TextValue"=>"내가 구덩이에 빠졌을 때 분명히 머리를 심하게 부딪친 것 같아. 봐봐, 나 걸을 때 아직도 좀 비틀거리고 있잖아."],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3060510","TextValue"=>"옆에 있는 작은 노점은 당신 것인가요? 위에 "배고파 죽겠으니 물건 사세요. 음식 주세요"라고 적힌 거 말이에요?"],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3060511","TextValue"=>"이곳은 참 황량하군요, 그리고 이 노점의 팻말에 적힌 말이 지금 내 몸 상태와 마음의 소리를 정확히 묘사하고 있어요. 내가 보건대 이것은 내 것이에요."],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3060512","TextValue"=>"걱정 마세요, 저희 음식 많이 가지고 왔으니 텐트에서 편하게 드세요."],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3060513","TextValue"=>"그거 좋군!"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3060514","TextValue"=>"아, 그런데 한 가지 일이 있다네. 나는 공기 중에서 베이컨, 사과 구이 냄새를 맡았어 그리고... <color=#f58c26>곧 다가올 폭풍</color>의 냄새도. 얼른 준비하는 게 좋을 거야."],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3060601","TextValue"=>"그리고… 그녀는 그냥 갔어요. 네, 추장님도 들으셨죠. 여기 바람이 엄청 세요. 제가 보고 올게요."],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3060602","TextValue"=>"저희 텐트를 더 견고하게 보강해야 해요."],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3060603","TextValue"=>"우리가 무슨 근거로 그녀의 말을 들어야 하지! 그놈 출처도 불분명한데, 그러고 너는 그녀의 말을 믿다니!"],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3060604","TextValue"=>"나의 예언, 너는 항상 실수를 콕 집어서 비웃어! 나는 반드시 그 까닭을 물어서 이 늙은 여자가 본색을 드러내도록 만들겠어!"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3060605","TextValue"=>"하하 하하, 우리 제사장님은 아직도 인정하지 않네요. <color=#f58c26>텐트 보강</color>의 재료 목록들을 이미 준비해 놓았어요, 추장님, 확인해 주세요."],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3070101","TextValue"=>"음, 좋은 차군."],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3070102","TextValue"=>"이 과자도 괜찮은데. 입에 넣자마자 바로 녹아. 끝부분이 조금 탔네."],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3070103","TextValue"=>"다음에는 불을 약하게 해서 적당하게 시간을 조절하면 완벽할 거야."],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3070104","TextValue"=>"왜 그녀가 차를 마시고 있지?!"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3070105","TextValue"=>"무슨 문제 있나요?"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3070106","TextValue"=>"그리고 그 이상한 영국식 억양은 또 뭐야! 여기가 어느 시대야 대체!"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3070107","TextValue"=>"기분 좀 풀어, 귀여운 제사장. 모든 것은 다 지나가요. 너는 이해할 수 있을 거야."],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3070108","TextValue"=>"아니다! 아니야! 지나갈 일은 없어, 그리고 나도 잘 모르겠어!! 신이시여… 대체 어디서 오시는 건가요!"],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3070109","TextValue"=>"이미 이렇게 된 거 정성스럽게 물어봐, 사실 덕분에 조금 전 마신 차가 향수병을 불러일으키는군."],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3070110","TextValue"=>"내 기억이 어느 정도 회복된 것 같네. 사실, 진실되고, 이치에 맞게, 솔직히 말해서..."],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3070111","TextValue"=>"그냥 말하면 안 돼?!"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3070112","TextValue"=>"그 <color=#f58c26>작은 노점</color>, 당신들이 나를 대신해서 보강해 줄 수 있을까?"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3070113","TextValue"=>"뭐라고?!"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3070114","TextValue"=>"고비사막에서 나 같은 쇠약한 늙은이가 홀로 외롭게 걸었다니, 배가 고파서 꼬르륵 소리가 다 나네... 에이! 정말 불쌍해!"],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3070115","TextValue"=>"이 노점이 망가진다면, 나는 정말 괴로울걸세. 그러니 잘 부탁하네! 정말 고맙다네!"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3070116","TextValue"=>"얼마나 재미있는 할머니이신가."],
13956=>["Value"=>13956,"TextKey"=>"剧情ID3070117","TextValue"=>"미안하지만 뭐라고?"],
13957=>["Value"=>13957,"TextKey"=>"剧情ID3070118","TextValue"=>"추장님, 자료 리스트가 준비됐습니다. 확인해 주세요!"],
13958=>["Value"=>13958,"TextKey"=>"剧情ID3070119","TextValue"=>"무시하지 마!!"],
13959=>["Value"=>13959,"TextKey"=>"剧情ID3080101","TextValue"=>"아주 좋아, 너희들 정말 대단하네!"],
13960=>["Value"=>13960,"TextKey"=>"剧情ID3080102","TextValue"=>"엄마! 알고 있었어! 당신인 줄 알았어요!"],
13961=>["Value"=>13961,"TextKey"=>"剧情ID3080201","TextValue"=>"위대한 트라치카님, 당신이 왜 여기 계시나요?!"],
13962=>["Value"=>13962,"TextKey"=>"剧情ID3080202","TextValue"=>"이 젊은 여자는...?"],
13963=>["Value"=>13963,"TextKey"=>"剧情ID3080203","TextValue"=>"트라치카! 당신 딸! 모른척하지 마세요!"],
13964=>["Value"=>13964,"TextKey"=>"剧情ID3080204","TextValue"=>"소식을 전하던 사람이 내게 그들이 한 구덩이에서 눈먼 노부인을 꺼냈다고 말해 주었는데, 듣기에 엄마인 것 같아서 왔어."],
13965=>["Value"=>13965,"TextKey"=>"剧情ID3080205","TextValue"=>"역시 맞아!"],
13966=>["Value"=>13966,"TextKey"=>"剧情ID3080206","TextValue"=>"트라치카 님의 어머니… 나는 트라치카 님에게 어머니가 있다는 것을 들어본 적이 없어…"],
13967=>["Value"=>13967,"TextKey"=>"剧情ID3080207","TextValue"=>"당연히 어머니가 있지, 이 바보야!"],
13968=>["Value"=>13968,"TextKey"=>"剧情ID3080208","TextValue"=>"언어에 주의해."],
13969=>["Value"=>13969,"TextKey"=>"剧情ID3080209","TextValue"=>"이 정신 나간 여인이 바로 너희들의 모로스라고. 바로 너희들 눈앞에."],
13970=>["Value"=>13970,"TextKey"=>"剧情ID3080210","TextValue"=>"맥이라고 불러주겠나."],
13971=>["Value"=>13971,"TextKey"=>"剧情ID3080211","TextValue"=>"그런데 저는 모로스님이 남자인 줄 알았어요."],
13972=>["Value"=>13972,"TextKey"=>"剧情ID3080212","TextValue"=>"맞아, 엄마는 많은 사람이 될 수 있어. 내가 어렸을 때 그녀는 사람들에게 자신의 정체를 숨기고 다녔거든."],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3080213","TextValue"=>"생각해 봐, 맹인 여자와 세 살 아이인데 누구보다 이용당하기 쉽지 않겠어?"],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3080214","TextValue"=>"생각해 보니, 사람들이 이렇게 이야기를 퍼뜨리기 시작한 건 아닐까... 못하는 게 없는 드루이드, 모르는 게 없는 전사, 강한 기사..."],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3080215","TextValue"=>"실제로 그녀는 이상한 유머감각을 가진 눈이 안 보이는 노파일 뿐이에요."],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3080216","TextValue"=>"모로스는 여자다... 그리고 제가 모로스에게 불손한 말을 했는데... 오, 저는 망했습니다. 저는 제사장이 될 자격이 없어요..."],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3080217","TextValue"=>"꼬마 제사장, 슬퍼하지 마세요. 당신은 똑똑하니까~ 이번에는 용서해 줄게요, 그리고 귀엽잖아요~"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3080218","TextValue"=>"그래서 우리를 속인 건가요? 당신은 기억을 잃은 것이 아닌가요?"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3080219","TextValue"=>"네... 미안해요. 장거리 여행은 지루하잖아요? 그냥 심심해서요~"],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3080220","TextValue"=>"하지만, 저기, 저 아름다운 텐트와 저 아름다운 노점 좀 보세요! 이제야 좀 "영지" 같은데요! 뭔가 좀 부족해 보이는데."],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3080221","TextValue"=>"뭐가 부족하죠?"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3080222","TextValue"=>"어디 보자..."],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3080301","TextValue"=>"대문 하나! 영지 입구를 표시해 줄 대문이 필요하고, 그 위에 등을 달아주면 더할 나위 없이 아름다울 거예요!"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3080302","TextValue"=>"저희는 당신의 독실한 하인으로서 즉시 대문을 건설할 것입니다, 여사님! 추장님, 꾸물거리지 마세요!"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090101","TextValue"=>"재료는 다 준비되었습니까? 좋아요! 빨리 일하러 가요!"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090201","TextValue"=>"오! 활력이 넘쳐요! 건축은 이번이 처음이지만..."],
13987=>["Value"=>13987,"TextKey"=>"剧情ID3090202","TextValue"=>"축하합니다, 제사장님, 많이 성장하셨네요. 그런데 맥님이 저희 영지의 모습이 마음에 들어 할까요?"],
13988=>["Value"=>13988,"TextKey"=>"剧情ID3090203","TextValue"=>"다른 건 다 좋은데 텅 빈 하늘은 좀 심심하네요..."],
13989=>["Value"=>13989,"TextKey"=>"剧情ID3090204","TextValue"=>"맞아요! 맞아요! 저희는 하늘을 날 수 있는 신호 풍선이 있어요!"],
13990=>["Value"=>13990,"TextKey"=>"剧情ID3090205","TextValue"=>"좋은 생각이네요! 이 작은 것들을 조금만 조절해 주면 더욱 아름다울 거예요!"],
13991=>["Value"=>13991,"TextKey"=>"剧情ID3090206","TextValue"=>"당신들 저 빛나는 노란색 핑크색의 작은 돌들이 아직 남아 있나요?"],
13992=>["Value"=>13992,"TextKey"=>"剧情ID3090207","TextValue"=>"있어요!"],
13993=>["Value"=>13993,"TextKey"=>"剧情ID3090208","TextValue"=>"잘 됐네요. 잠시만요. 케빈, 따라와요."],
13994=>["Value"=>13994,"TextKey"=>"剧情ID3090301","TextValue"=>"아이고, 힘들어 죽겠네요. 그런데 이 작은 것 좀 봐요! 아름답지 않나요?"],
13995=>["Value"=>13995,"TextKey"=>"剧情ID3090302","TextValue"=>"확실히 아름다워요."],
13996=>["Value"=>13996,"TextKey"=>"剧情ID3090303","TextValue"=>"너희가 좋으면 됐어. 엄마가 만든 것은 보통 정상이 아니야. 어쨌든, 시간이 늦었으니, 나는 돌아가야 해."],
13997=>["Value"=>13997,"TextKey"=>"剧情ID3090304","TextValue"=>"지금 가시게요?"],
13998=>["Value"=>13998,"TextKey"=>"剧情ID3090305","TextValue"=>"그래, 그렇지 않으면? 너희들 같은 냄새 나는 노인네랑 영지 안에 있으라고! 엄마, 저랑 같이 갈래요?"],
13999=>["Value"=>13999,"TextKey"=>"剧情ID3090306","TextValue"=>"금방 돌아올게요. 너의 새 친구들은 정말 사랑스러워 보이는데, 특히 이 꼬마 제사장~ 나는 그들과 좀 더 놀고 싶어~"],
14000=>["Value"=>14000,"TextKey"=>"剧情ID3090307","TextValue"=>"엄마, 자제하세요."],
14001=>["Value"=>14001,"TextKey"=>"剧情ID3090308","TextValue"=>"알겠어, 알겠어, 이제 자제할 수 있어. 어쨌든 우리는 앞으로 함께 가야 할 길이 많이 남았어."],
14002=>["Value"=>14002,"TextKey"=>"剧情ID3090309","TextValue"=>"좋아요, 그럼 이따가 봐요."],
14003=>["Value"=>14003,"TextKey"=>"剧情ID3090401","TextValue"=>"저희와 함께 할 거라는 건가요?"],
14004=>["Value"=>14004,"TextKey"=>"剧情ID3090402","TextValue"=>"그럼요! 안 될게 뭐가 있어요! 당신들의 여정은 더욱 험난해질 거라고요."],
14005=>["Value"=>14005,"TextKey"=>"剧情ID3090403","TextValue"=>"나는 아무것도 할 수 없지만, 적어도 미래에 대해서 알려줄 수 있어요."],
14006=>["Value"=>14006,"TextKey"=>"剧情ID3090404","TextValue"=>"하지만 당신들 집으로 가는 길을 가르쳐 주어야 해요. 내 방향감각은... 상상하기 어려울 정도로 형편없거든요."],
14007=>["Value"=>14007,"TextKey"=>"剧情ID4010101","TextValue"=>"후... 세상엔 왜 이런 곳이 있나요! 제 발은 화염을 밟은 것 같아요......"],
14008=>["Value"=>14008,"TextKey"=>"剧情ID4010102","TextValue"=>"멋있군요 엔다! 후..... 네 시간 전부터 다섯 글자 이상의 문장을 얘기하지 않고 있어요."],
14009=>["Value"=>14009,"TextKey"=>"剧情ID4010103","TextValue"=>"난.... 너무 힘들고.... 너무 더워요...."],
14010=>["Value"=>14010,"TextKey"=>"剧情ID4010104","TextValue"=>"이 엄살쟁이들! 화산일 뿐인데 땅속에 숨으려는 모습들하고는!"],
14011=>["Value"=>14011,"TextKey"=>"剧情ID4010105","TextValue"=>"여사님... 당신의 땀이 끝없이 흐르는 강이 되었어요. 정말 괜찮으세요?"],
14012=>["Value"=>14012,"TextKey"=>"剧情ID4010106","TextValue"=>"트라치카라고 불러주세요! .....전 힘들진 않은데 너무 덥네요.... 여긴 바다보다 더 위험하군요."],
14013=>["Value"=>14013,"TextKey"=>"剧情ID4010107","TextValue"=>"우린 아마 도착한 것 같아요."],
14014=>["Value"=>14014,"TextKey"=>"剧情ID4010108","TextValue"=>"봐봐요! 여신의 계시엔 연소하는 바다, 그리고 그중의 섬...."],
14015=>["Value"=>14015,"TextKey"=>"剧情ID4010109","TextValue"=>"그래, 바로 여기야!"],
14016=>["Value"=>14016,"TextKey"=>"剧情ID4010110","TextValue"=>"하지만 메이진은 어디 있죠? 메이진은 일찍 도착해서 우릴 기다려야 하는데. 어디에도 보이지 않아요."],
14017=>["Value"=>14017,"TextKey"=>"剧情ID4010111","TextValue"=>"난 메이진의 텔레파시를 받으러 제단을 건설해야겠어요. 하지만...."],
14018=>["Value"=>14018,"TextKey"=>"剧情ID4010201","TextValue"=>"후... 부족장님, 난..."],
14019=>["Value"=>14019,"TextKey"=>"剧情ID4010202","TextValue"=>"엔다!"],
14020=>["Value"=>14020,"TextKey"=>"剧情ID4010203","TextValue"=>"엔다!"],
14021=>["Value"=>14021,"TextKey"=>"剧情ID4010204","TextValue"=>"그녀는 더위를 먹었을 거에요! 빨리, 시원한 곳을 만들어 쉬게 해줘요!"],
14022=>["Value"=>14022,"TextKey"=>"剧情ID4020101","TextValue"=>"장관님, 건설 했습니다!"],
14023=>["Value"=>14023,"TextKey"=>"剧情ID4020102","TextValue"=>"신이시여! 저 조금 더 살 수 있을 것 같습니다..."],
14024=>["Value"=>14024,"TextKey"=>"剧情ID4020103","TextValue"=>"너무 덥잖아요! 바닷물의 냄새가 너무 그리워요...."],
14025=>["Value"=>14025,"TextKey"=>"剧情ID4020104","TextValue"=>"휴, 우리의 제사님이 괜찮아 보여요."],
14026=>["Value"=>14026,"TextKey"=>"剧情ID4020105","TextValue"=>"텐트가 좋긴 하지만 불어오는 따뜻한 바람이 없네요...."],
14027=>["Value"=>14027,"TextKey"=>"剧情ID4020106","TextValue"=>"조금 나아졌을 뿐이에요."],
14028=>["Value"=>14028,"TextKey"=>"剧情ID4020107","TextValue"=>"여신님이시여, 저를 뒤집어 주세요, 그래야 골고루 굽힌답니다."],
14029=>["Value"=>14029,"TextKey"=>"剧情ID4020108","TextValue"=>"여긴 확실히 큰 오븐 같다고 얘기하고 싶어요."],
14030=>["Value"=>14030,"TextKey"=>"剧情ID4020109","TextValue"=>"봐요! 저기 낮은 곳을요."],
14031=>["Value"=>14031,"TextKey"=>"剧情ID4020110","TextValue"=>"기다려 봐요! 우리 어머니는 천재를 낳았네!"],
14032=>["Value"=>14032,"TextKey"=>"剧情ID4030101","TextValue"=>"위대한 트라치카! 저건 물, 물이야!"],
14033=>["Value"=>14033,"TextKey"=>"剧情ID4030102","TextValue"=>"하, 우리의 독실한 제사님이 여신님을 뵌 줄 알았어요."],
14034=>["Value"=>14034,"TextKey"=>"剧情ID4030103","TextValue"=>"전 살아 돌아왔습니다, 살아있는 게 좋군요!"],
14035=>["Value"=>14035,"TextKey"=>"剧情ID4030104","TextValue"=>"확실히 활력 있어 보이네요!"],
14036=>["Value"=>14036,"TextKey"=>"剧情ID4030105","TextValue"=>"그렇다면 너, 너, 그리고 너, 어서 훈련소를 건설해요!"],
14037=>["Value"=>14037,"TextKey"=>"剧情ID4030106","TextValue"=>"훈련소?"],
14038=>["Value"=>14038,"TextKey"=>"剧情ID4030107","TextValue"=>"그래, 맞아요!"],
14039=>["Value"=>14039,"TextKey"=>"剧情ID4030108","TextValue"=>"우리 메이진을 찾아가야 하는 게 아닐까요?"],
14040=>["Value"=>14040,"TextKey"=>"剧情ID4030109","TextValue"=>"메이진 그 늙은이를 난 알아요. 바람을 불러오고 비를 내리게 하죠."],
14041=>["Value"=>14041,"TextKey"=>"剧情ID4030110","TextValue"=>"당신들을 봐봐요, 여기까지 왔는데도 힘들어하잖아요. 체력 훈련을 게을리하면 안 돼요."],
14042=>["Value"=>14042,"TextKey"=>"剧情ID4030111","TextValue"=>"맞아요, 엔다는 훈련이 필요해요."],
14043=>["Value"=>14043,"TextKey"=>"剧情ID4030112","TextValue"=>"입 다물어요!"],
14044=>["Value"=>14044,"TextKey"=>"剧情ID4030113","TextValue"=>"우리 어머니의 예언대로라면 우린 더 큰 폭풍을 만날 거에요...."],
14045=>["Value"=>14045,"TextKey"=>"剧情ID4030114","TextValue"=>"모로스의 예언...."],
14046=>["Value"=>14046,"TextKey"=>"剧情ID4030115","TextValue"=>"젊은이들!"],
14047=>["Value"=>14047,"TextKey"=>"剧情ID4030116","TextValue"=>"알겠습니다!"],
14048=>["Value"=>14048,"TextKey"=>"剧情ID4040101","TextValue"=>"북쪽의 높은 곳을 봐요! 천연의 계단이 있어요."],
14049=>["Value"=>14049,"TextKey"=>"剧情ID4040102","TextValue"=>"네, 장관님!"],
14050=>["Value"=>14050,"TextKey"=>"剧情ID4040103","TextValue"=>"가운데 기둥을 봤어요? 저건 천연이 아닐 거에요."],
14051=>["Value"=>14051,"TextKey"=>"剧情ID4040104","TextValue"=>"저 높이와 모양은 내 제사 가문의 명예를 걸고 얘기하지, 예전엔 제단이었을 거에요!"],
14052=>["Value"=>14052,"TextKey"=>"剧情ID4040105","TextValue"=>"쓸쓸해 보이는 제단이군요."],
14053=>["Value"=>14053,"TextKey"=>"剧情ID4040106","TextValue"=>"맞아요, 시간이 꽤 됐죠."],
14054=>["Value"=>14054,"TextKey"=>"剧情ID4040107","TextValue"=>"이런 제단은 대 드루이드와 힘을 공명할 수 없어 메이진을 찾지 못할 거에요."],
14055=>["Value"=>14055,"TextKey"=>"剧情ID4040108","TextValue"=>"족장님, 우린 에너지를 응결시킬 장치가 필요해요....."],
14056=>["Value"=>14056,"TextKey"=>"剧情ID4040109","TextValue"=>"재료는 여기의 온도를 견딜 수 있고 모양은 집결되고....."],
14057=>["Value"=>14057,"TextKey"=>"剧情ID4040110","TextValue"=>"용암의 이상한 이빨들은 어때요?"],
14058=>["Value"=>14058,"TextKey"=>"剧情ID4040111","TextValue"=>"좋아요! 아란, 출발 전에 여신님이 귀띔하신 중요한 파트너와 동행하라는 뜻을 알았어!"],
14059=>["Value"=>14059,"TextKey"=>"剧情ID4040112","TextValue"=>"그러니까요, 감사합니다. 여신님!"],
14060=>["Value"=>14060,"TextKey"=>"剧情ID4040113","TextValue"=>"입 다물어요! 당신은 아니에요!"],
14061=>["Value"=>14061,"TextKey"=>"剧情ID4040114","TextValue"=>"재료를 우리 위대한 족장에게 바치죠!"],
14062=>["Value"=>14062,"TextKey"=>"剧情ID4050101","TextValue"=>"족장님, 우리 진행도는 만족스러워요."],
14063=>["Value"=>14063,"TextKey"=>"剧情ID4050102","TextValue"=>"제단은 사용하는데 문제없을 것 같아요!"],
14064=>["Value"=>14064,"TextKey"=>"剧情ID4050103","TextValue"=>"하지만 지금 흐릿한 날씨를 봐요, 엔다가 제단을 오르내리는 데 너무 힘들 거에요, 떨어지면 어떡해요?"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4050104","TextValue"=>"그래요, 스탠은 무슨, 당신도 항상 혐오스러운 건 아니군요."],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4050105","TextValue"=>"엔다의 나이가 확실히, 음, 젊진 않지...."],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4050106","TextValue"=>"내가 화병 나면 당신한테 좋은 게 뭔데요?"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4050107","TextValue"=>"그럼 우리가 계단 양켠에 횃불을 설치해요, 이건 쉬워요!"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060101","TextValue"=>"이 제단.... 내 느낌엔 아직도 뭔가 부족해요, 여신의 텔레파시를 받을 수 없어요...."],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4060102","TextValue"=>"하지만 메이진의 텔레파시는 받을 수 있을 거예요!"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4060103","TextValue"=>"추워....누....누구야? ....."],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4060104","TextValue"=>"메이진! 어디죠?"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4060105","TextValue"=>"당.....당신은 엔다? 모르겠어요 여기가 어디인지... 하지만 너무 추워요...."],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4060106","TextValue"=>"춥다고요?"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4060107","TextValue"=>"이곳은 아닌 것 같아."],
14076=>["Value"=>14076,"TextKey"=>"剧情ID4060108","TextValue"=>"난 못 움직이겠어요..... 도와줘요, $#^*,!@%&:?""],
14077=>["Value"=>14077,"TextKey"=>"剧情ID4060109","TextValue"=>"뭐라고요?"],
14078=>["Value"=>14078,"TextKey"=>"剧情ID4060110","TextValue"=>"여보세요, 엔다, 내가....."],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"…"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4060112","TextValue"=>"메이진 잠깐만요! 난 다른 사람이랑 통화해야 겠어요, 당신을 도울 수 있을 거예요."],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4060113","TextValue"=>"트라치카, 이런 상황 본 적 있어요?"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4060114","TextValue"=>"여보세요...."],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4060115","TextValue"=>"정신교류는 내 특기가 아니에요. 하지만 우리 어머니도 이런 상황을 본 적 있어요, 아마 제단의 문제일 겁니다."],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4060116","TextValue"=>"제단의 힘은 너무 약해요, 중요한 것이 하나 빠졌어요."],
14085=>["Value"=>14085,"TextKey"=>"剧情ID4060117","TextValue"=>"여신의 힘… @#$>:%^정수....."],
14086=>["Value"=>14086,"TextKey"=>"剧情ID4060118","TextValue"=>"족장님, 알았어요, 제단위의 홈을 봐요!"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4060119","TextValue"=>"정백을 보충해 제단의 힘을 강화해야 해, 우리 정백이 있었나?"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4060120","TextValue"=>"글쎄? 아란, 너희에게 맡길께."],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4060121","TextValue"=>"문제없습니다!"],
14090=>["Value"=>14090,"TextKey"=>"剧情ID4070101","TextValue"=>"메이진, 뭐라고 말 좀해요!"],
14091=>["Value"=>14091,"TextKey"=>"剧情ID4070102","TextValue"=>"나를 찾으러 와줘야 겠어...."],
14092=>["Value"=>14092,"TextKey"=>"剧情ID4070103","TextValue"=>"이번엔 문제 없어요, 당신 목소리가 드디어 기침 시늉하는 맥처럼 들리지 않아요, 참 힘들었죠!"],
14093=>["Value"=>14093,"TextKey"=>"剧情ID4070104","TextValue"=>"맥은 할머니야."],
14094=>["Value"=>14094,"TextKey"=>"剧情ID4070105","TextValue"=>"그렇게 얘기하면...."],
14095=>["Value"=>14095,"TextKey"=>"剧情ID4070106","TextValue"=>"난 화산에 간 적 있어, 하지만 아무 기억이 않나. 정신을 차려보니까 여기에 왔더라고. 여기가 어딘진 나도 몰라."],
14096=>["Value"=>14096,"TextKey"=>"剧情ID4070107","TextValue"=>"비록 너희 제단이 나와 연락이 닿았지만 내가 어디있는 지 인도하진 못하겠어..."],
14097=>["Value"=>14097,"TextKey"=>"剧情ID4070108","TextValue"=>"내가 엔다를 접수하고 대답할 수 있지만 이곳은.... 안 될 거야. 방법을 써 숨으려 할 거야."],
14098=>["Value"=>14098,"TextKey"=>"剧情ID4070109","TextValue"=>"방법이 있나요?"],
14099=>["Value"=>14099,"TextKey"=>"剧情ID4070110","TextValue"=>"환경과 같이 공생해야 해.... 끊임없이 생장하고 번성해 순환이 되는 거지."],
14100=>["Value"=>14100,"TextKey"=>"剧情ID4070111","TextValue"=>"무슨 뜻이지? 우리의 불을 그곳 얼음장에 가게 해야 돼요?"],
14101=>["Value"=>14101,"TextKey"=>"剧情ID4070112","TextValue"=>"이 단순한 바보야! 당연히 아니지."],
14102=>["Value"=>14102,"TextKey"=>"剧情ID4070113","TextValue"=>"순환.... 용암을 유동시켜 먼지를 일으키고, 먼지를 냉각시켜 돌덩이를 용암으로 만드는 것."],
14103=>["Value"=>14103,"TextKey"=>"剧情ID4070114","TextValue"=>"넌 우수학생이구나."],
14104=>["Value"=>14104,"TextKey"=>"剧情ID4070115","TextValue"=>"잠깐!"],
14105=>["Value"=>14105,"TextKey"=>"剧情ID4080101","TextValue"=>"이건... 돼지 머리?"],
14106=>["Value"=>14106,"TextKey"=>"剧情ID4080102","TextValue"=>"흥흥."],
14107=>["Value"=>14107,"TextKey"=>"剧情ID4080103","TextValue"=>"다 이해했는데, 왜 하필 돼지 머리 모양인 거야?"],
14108=>["Value"=>14108,"TextKey"=>"剧情ID4080104","TextValue"=>"잠까, 이 문제를 물어보지 말았어야 했어."],
14109=>["Value"=>14109,"TextKey"=>"剧情ID4080105","TextValue"=>"여신님께, 성공의 길엔 친애하는 파트너가 없으면 안되죠. 왜 내 파트너를 스탠의 흔적을 여기에 놓았죠?"],
14110=>["Value"=>14110,"TextKey"=>"剧情ID4080106","TextValue"=>"우리 제사 너무 귀엽네, 이 모호한 호감 표시를 봐요."],
14111=>["Value"=>14111,"TextKey"=>"剧情ID4080107","TextValue"=>"너!"],
14112=>["Value"=>14112,"TextKey"=>"剧情ID4080108","TextValue"=>"비켜 봐, 나와 족장님이 이 제단을 발동할꺼야."],
14113=>["Value"=>14113,"TextKey"=>"剧情ID4090101","TextValue"=>"후, 엔다, 부탁할께."],
14114=>["Value"=>14114,"TextKey"=>"剧情ID4090102","TextValue"=>"메이진은..."],
14115=>["Value"=>14115,"TextKey"=>"剧情ID4090103","TextValue"=>"아주먼 동쪽.... 얼음과 서리로 뒤덮힌 금기된 곳에 있어."],
14116=>["Value"=>14116,"TextKey"=>"剧情ID4090104","TextValue"=>"비록 지금은 연기날 정도로 덥지만 우린 아마 방한 옷을 준비해야 할꺼야."],
14117=>["Value"=>14117,"TextKey"=>"剧情ID99990101","TextValue"=>"That fog looks more suspicious than any crisis I have resolved since the establishment of the Royal Kingdom ever."],
14118=>["Value"=>14118,"TextKey"=>"剧情ID99990102","TextValue"=>"And it seems we are kind of stuck here. Hmmm, anybody here?"],
14119=>["Value"=>14119,"TextKey"=>"剧情ID99990103","TextValue"=>"Not a soul? Guess we have to figure out how to clear the fog all by ourselves."],
14120=>["Value"=>14120,"TextKey"=>"剧情ID47990201","TextValue"=>"Hey! Well done! The wheat appeared for a reason! "],
14121=>["Value"=>14121,"TextKey"=>"剧情ID99990202","TextValue"=>"Let's harvest some first and then see what can we do with them!"],
14122=>["Value"=>14122,"TextKey"=>"剧情ID99990301","TextValue"=>"Oh! A little spellbook! It appeared all of a sudden after I had the bread."],
14123=>["Value"=>14123,"TextKey"=>"剧情ID99990302","TextValue"=>"The fog seems thinned a bit because of the spellbook… Maybe we can use the spellbook to clear the fog away."],
14124=>["Value"=>14124,"TextKey"=>"剧情ID34990101","TextValue"=>"Great! Now let's make a plan: merge ingredients, cook foods, get spellbooks, and last but most importantly -- clear fog!"],
14125=>["Value"=>14125,"TextKey"=>"剧情ID99990601","TextValue"=>"Ha! What's that? Looks like there is a chest buried under those broken stones."],
14126=>["Value"=>14126,"TextKey"=>"剧情ID99990602","TextValue"=>"Let's open it at once and see what's inside! I can't wait to tell my friends about all this!"],
14127=>["Value"=>14127,"TextKey"=>"剧情ID99990701","TextValue"=>"It seems we have to stay here for a little while. We should make use of these stones and build a shelter."],
14128=>["Value"=>14128,"TextKey"=>"剧情ID99990702","TextValue"=>"We did it! Indeed, whatever magic in that spellbook certainly worked!"],
14129=>["Value"=>14129,"TextKey"=>"剧情ID99991001","TextValue"=>"I'm curious about what's gonna happen if we merge 5 items of the same kind at once."],
14130=>["Value"=>14130,"TextKey"=>"剧情ID99991002","TextValue"=>"I think we should give it a go. It seems like something wonderful might follow…"],
14131=>["Value"=>14131,"TextKey"=>"剧情ID99990801","TextValue"=>"What's this?"],
14132=>["Value"=>14132,"TextKey"=>"剧情ID99990802","TextValue"=>"It looks like nothing but ruins. But in a very short time, I promise my brother and I can build a perfect base for a stone castle! "],
14133=>["Value"=>14133,"TextKey"=>"剧情ID99990803","TextValue"=>"Right on! The most urgent affair should be constructing a solid castle to shield us against unknown challenges."],
14134=>["Value"=>14134,"TextKey"=>"剧情ID99990501","TextValue"=>"This hat is beaming faint magic."],
14135=>["Value"=>14135,"TextKey"=>"剧情ID99990502","TextValue"=>"Keep merging! I think this might be a clue that leads us to the right man to help us!"],
14136=>["Value"=>14136,"TextKey"=>"剧情ID99990901","TextValue"=>"What is this magical base with four slots on top? Looks like we need something to activate it!"],
14137=>["Value"=>14137,"TextKey"=>"剧情ID99990902","TextValue"=>"Your Majesty, this is a base for a castle. As long as we build the corresponding houses and place them on top of it, we can easily construct our Royal Castle."],
14138=>["Value"=>14138,"TextKey"=>"剧情ID99990903","TextValue"=>"We will remind you to place those houses on top after we finished construction."],
14139=>["Value"=>14139,"TextKey"=>"剧情ID99991101","TextValue"=>"I can't wait to find out what kind of mysterious treasure is hidden inside."],
14140=>["Value"=>14140,"TextKey"=>"剧情ID99991102","TextValue"=>"We can use it to to merge with stone  resources. Then we can have unlimited stones!"],
14141=>["Value"=>14141,"TextKey"=>"剧情ID99991201","TextValue"=>"Very helpful magic crystal! It can be played as anything you want!"],
14142=>["Value"=>14142,"TextKey"=>"剧情ID99991202","TextValue"=>"With it, you only need 2, not 3, of the same item to merge! Try using it!"],
14143=>["Value"=>14143,"TextKey"=>"剧情ID99991203","TextValue"=>"Remember the Magic Crystal can substitute any item you need in game!"],
14144=>["Value"=>14144,"TextKey"=>"剧情ID30400301","TextValue"=>"Look at this little cute stone frame!"],
14145=>["Value"=>14145,"TextKey"=>"剧情ID30400302","TextValue"=>"Compared to my finest architecture, this is far from close. Come on, Watt! We need more stone bricks!"],
14146=>["Value"=>14146,"TextKey"=>"剧情ID30400401","TextValue"=>"Not bad! You built a door with stones."],
14147=>["Value"=>14147,"TextKey"=>"剧情ID30400402","TextValue"=>"Thanks for your kind words. Please give us more time, we can surely build something better!"],
14148=>["Value"=>14148,"TextKey"=>"剧情ID30400501","TextValue"=>"You guys are indeed excellent stonecutter!"],
14149=>["Value"=>14149,"TextKey"=>"剧情ID30400601","TextValue"=>"Wally and I have constructed a much bigger stone house. I have to say that the arduous efforts we had made totally paid back."],
14150=>["Value"=>14150,"TextKey"=>"剧情ID30400602","TextValue"=>"You sure did! Now, I need a high tower to watch the remote lands."],
14151=>["Value"=>14151,"TextKey"=>"剧情ID30400701","TextValue"=>"With only four more houses like this, I can finally have a Castle on this land."],
14152=>["Value"=>14152,"TextKey"=>"剧情ID30400801","TextValue"=>"Castle completed! We can see it as a treasure box!"],
14153=>["Value"=>14153,"TextKey"=>"剧情ID30400802","TextValue"=>"That's right! There are so many goodies inside the Castle."],
14154=>["Value"=>14154,"TextKey"=>"剧情ID31610301","TextValue"=>"The power of the magic hat is greatly boosted! We should find its master for they must a mighty warlock!"],
14155=>["Value"=>14155,"TextKey"=>"剧情ID31610401","TextValue"=>"Humpf! A rabbit!"],
14156=>["Value"=>14156,"TextKey"=>"剧情ID31610402","TextValue"=>"Haha. Yup! If you have fresh and juicy carrots, don't forget my name… Oh, that will be Morris."],
14157=>["Value"=>14157,"TextKey"=>"剧情ID31610403","TextValue"=>"Morris, then you are destined to join my army! Speaking of the knowledge of delicacies, I'm second to none in the whole Hill Kingdom."],
14158=>["Value"=>14158,"TextKey"=>"剧情ID30410301","TextValue"=>"There are logs. We can build a much more comfortable house."],
14159=>["Value"=>14159,"TextKey"=>"剧情ID30410302","TextValue"=>"Cool. Take it slow this time. There is still time till the cold season creeps."],
14160=>["Value"=>14160,"TextKey"=>"剧情ID30410401","TextValue"=>"A decent ceiling at last."],
14161=>["Value"=>14161,"TextKey"=>"剧情ID30410402","TextValue"=>"Keep going! My fireplace is missing a chimney."],
14162=>["Value"=>14162,"TextKey"=>"剧情ID30410501","TextValue"=>"Why don't we build a lovely attic to reserve all my yummy carrots? They are the best foods in winter."],
14163=>["Value"=>14163,"TextKey"=>"剧情ID30410502","TextValue"=>"Haha, aren't carrots the best foods in all four seasons to you, Morris?"],
14164=>["Value"=>14164,"TextKey"=>"剧情ID30410601","TextValue"=>"I think I can use some more space to equip my little magic widgets."],
14165=>["Value"=>14165,"TextKey"=>"剧情ID30410602","TextValue"=>"The frame structure I designed is perfect for a bigger house."],
14166=>["Value"=>14166,"TextKey"=>"剧情ID30410701","TextValue"=>"What a beautiful house! Watt and Wally, I didn't expect your woodwork skills to be equally excellent!"],
14167=>["Value"=>14167,"TextKey"=>"剧情ID30410801","TextValue"=>"I can't believe one can actually build an outstanding architecture with zero magic spell cast."],
14168=>["Value"=>14168,"TextKey"=>"剧情ID30410802","TextValue"=>"My brother is an expert in architecture design. As for me… I'm good at being a cheerleader."],
14169=>["Value"=>14169,"TextKey"=>"剧情ID30410803","TextValue"=>"Watt, we need to catch up!"],
14170=>["Value"=>14170,"TextKey"=>"剧情ID30410901","TextValue"=>"Behold! A warm and cozy castle is ready!"],
14171=>["Value"=>14171,"TextKey"=>"剧情ID30410902","TextValue"=>"Nice! It is warm in winter and cool in summer! I suggest you prepare some hot biscuits for afternoon tea in winter times."],
14172=>["Value"=>14172,"TextKey"=>"剧情ID30410903","TextValue"=>"Or some carrot cakes and loaves of bread."],
14173=>["Value"=>14173,"TextKey"=>"剧情ID31620301","TextValue"=>"Morris, who would need these many harps?"],
14174=>["Value"=>14174,"TextKey"=>"剧情ID31620302","TextValue"=>"Ummm, I can't think of anyone. But this person must be a musician!"],
14175=>["Value"=>14175,"TextKey"=>"剧情ID31620401","TextValue"=>"I feel the power within these harps continues to grow."],
14176=>["Value"=>14176,"TextKey"=>"剧情ID31620501","TextValue"=>"These harps can be the best sword for a musician. So, can it keep leveling up?"],
14177=>["Value"=>14177,"TextKey"=>"剧情ID31620601","TextValue"=>"I can almost see the grandness of this harp being played in a luxurious music hall of the House of Hill."],
14178=>["Value"=>14178,"TextKey"=>"剧情ID31620602","TextValue"=>"I believe the owner of this harp will be given such a chance."],
14179=>["Value"=>14179,"TextKey"=>"剧情ID31620701","TextValue"=>"I'm Ramble, your humble servant. I have one more thing to celebrate in songs!"],
14180=>["Value"=>14180,"TextKey"=>"剧情ID31620702","TextValue"=>"Umm, can someone please make me an Icecream Muffin? I'm sure your beautiful music will be a perfect combo to it, which is even better than cinnamon powder!"],
14181=>["Value"=>14181,"TextKey"=>"剧情ID31620703","TextValue"=>"*In the arc music hall, in the breezy spring fields, in the presence of the one, whom the hymn gives*"],
14182=>["Value"=>14182,"TextKey"=>"剧情ID30420401","TextValue"=>"I quite like this exquisite door. Well, perhaps a wind vane will be needed over the sea?"],
14183=>["Value"=>14183,"TextKey"=>"剧情ID30420501","TextValue"=>"Ohh, it so reminds me of those old adventure days. Listen, we need to increase the height of the base. Y'all know waves crashing is no kidding."],
14184=>["Value"=>14184,"TextKey"=>"剧情ID30420601","TextValue"=>"Pretty good! Wally, you are no doubt a genius!"],
14185=>["Value"=>14185,"TextKey"=>"剧情ID30420602","TextValue"=>"Haha, Wally never fails you! And... since I've known him for my life, it's far from the time to celebrate."],
14186=>["Value"=>14186,"TextKey"=>"剧情ID30420701","TextValue"=>"Praise be to the brilliant craftsman! And what else do we need… bright lights dancing in the dark night, becoming the only beacon to the travelers."],
14187=>["Value"=>14187,"TextKey"=>"剧情ID30420801","TextValue"=>"What a wonderful boathouse! With only a couple more like this, our cruise ship will be ready to set sail!"],
14188=>["Value"=>14188,"TextKey"=>"剧情ID30420901","TextValue"=>"I can hear the waves beating and I can smell the storm coming! How exciting!"],
14189=>["Value"=>14189,"TextKey"=>"剧情ID30420902","TextValue"=>"Haha, check out Ramble's dreaming about adventures already! Watt and Wally, you two are indeed the best craftsmen ever!"],
14190=>["Value"=>14190,"TextKey"=>"剧情ID30420903","TextValue"=>"Thanks for your appreciation, Your Majesty! This boat castle also means our strength is greatly enhanced! "],
14191=>["Value"=>14191,"TextKey"=>"剧情ID31630301","TextValue"=>"That drum grew taller, looking like it's for an adult now! I want to jam a little bit, lol!"],
14192=>["Value"=>14192,"TextKey"=>"剧情ID31630401","TextValue"=>"In my opinion, a belt is needed for the drum. That'll be protective to the drumhead."],
14193=>["Value"=>14193,"TextKey"=>"剧情ID31630501","TextValue"=>"How about a fixation on the drum frame? Ramble knows musicians like him will get so carried away during the performance. It'll be a shame if it goes broken."],
14194=>["Value"=>14194,"TextKey"=>"剧情ID31630502","TextValue"=>"Correct. I should count how many harps I've played. One, two, three, four…"],
14195=>["Value"=>14195,"TextKey"=>"剧情ID31630601","TextValue"=>"The feather decoration looks very cute and unique. What do you think, Ramble?"],
14196=>["Value"=>14196,"TextKey"=>"剧情ID31630602","TextValue"=>"Yeah… but it might get in the way while playing. It's better to change the décor's location."],
14197=>["Value"=>14197,"TextKey"=>"剧情ID31630701","TextValue"=>"Now, it won't bother beating the drum. "],
14198=>["Value"=>14198,"TextKey"=>"剧情ID31630702","TextValue"=>"But the original simplicity and delicate beauty are weakened. Ramble, do you think you can improve that?"],
14199=>["Value"=>14199,"TextKey"=>"剧情ID31630801","TextValue"=>"Did you guys find my drum? Thanks!"],
14200=>["Value"=>14200,"TextKey"=>"剧情ID31630802","TextValue"=>"What a lovely wee lass!"],
14201=>["Value"=>14201,"TextKey"=>"剧情ID31630803","TextValue"=>"*Giggles* Thank you. I'm Melody, feel free to call me Mel! I have no idea why I woke up here in the fog."],
14202=>["Value"=>14202,"TextKey"=>"剧情ID31630804","TextValue"=>"That happened to everybody. Mel, glad you are joining us in this adventure!"],
14203=>["Value"=>14203,"TextKey"=>"剧情ID30430301","TextValue"=>"Beautiful pearl! I always want one, even though it doesn't have any function."],
14204=>["Value"=>14204,"TextKey"=>"剧情ID30430302","TextValue"=>"I know you'll like it! Well, Mel, we can build a pearl house next."],
14205=>["Value"=>14205,"TextKey"=>"剧情ID30430401","TextValue"=>"Wally is so creative! Pearl rooftop will be beautiful, but wouldn't that be too fragile?"],
14206=>["Value"=>14206,"TextKey"=>"剧情ID30430501","TextValue"=>"Dearest Watt and Wally, can you build it more spacious? More space is needed to stock pearls and shells."],
14207=>["Value"=>14207,"TextKey"=>"剧情ID30430502","TextValue"=>"One sec."],
14208=>["Value"=>14208,"TextKey"=>"剧情ID30430601","TextValue"=>"How about adding some seaweeds as décor?"],
14209=>["Value"=>14209,"TextKey"=>"剧情ID30430701","TextValue"=>"Stunning! Hahaha, I'm so happy. Can't stop smiling whenever I see the pearl house."],
14210=>["Value"=>14210,"TextKey"=>"剧情ID30430702","TextValue"=>"Aww, Mel, wait a sec. I stole — I mean, borrowed the design sketch from Wally."],
14211=>["Value"=>14211,"TextKey"=>"剧情ID30430801","TextValue"=>"Wow! There are two spires! This landscape is so glorious that I haven't seen it even in my most unstrained dream!"],
14212=>["Value"=>14212,"TextKey"=>"剧情ID30430802","TextValue"=>"It only takes four mansions like this to build a top-notch castle."],
14213=>["Value"=>14213,"TextKey"=>"剧情ID30430901","TextValue"=>"What do you think? Not bad, right? I knew Mel would love those spires."],
14214=>["Value"=>14214,"TextKey"=>"剧情ID30430902","TextValue"=>"Can I look around? Alrighty! I'm coming in! Aha, where's my drum? I want to drop some beats."],
14215=>["Value"=>14215,"TextKey"=>"剧情ID30430903","TextValue"=>"Let me be your accompany, Mel."],
14216=>["Value"=>14216,"TextKey"=>"剧情ID31640301","TextValue"=>"This crown should belong to someone important. Your Majesty, does that ring any bells?"],
14217=>["Value"=>14217,"TextKey"=>"剧情ID31640302","TextValue"=>"I'm not sure. It doesn't have the Royal Lable of House Hill. So, I really can't think of anyone who it belongs."],
14218=>["Value"=>14218,"TextKey"=>"剧情ID31640401","TextValue"=>"Magnificent gold, workmanship glowed. Used as a symbol in poems, represent power the most."],
14219=>["Value"=>14219,"TextKey"=>"剧情ID31640501","TextValue"=>"Inlaid with emerald, ha, very much in line with my Queen's aesthetic!"],
14220=>["Value"=>14220,"TextKey"=>"剧情ID31640601","TextValue"=>"What? Morris just told me such a luxurious crown is not even superior!"],
14221=>["Value"=>14221,"TextKey"=>"剧情ID31640602","TextValue"=>"Yup. I can feel the magic power hidden in the crown is far from the upper limit."],
14222=>["Value"=>14222,"TextKey"=>"剧情ID31640701","TextValue"=>"When the crown's owner came, I wonder if I could borrow to try it on? It is sooooo pretty!"],
14223=>["Value"=>14223,"TextKey"=>"剧情ID31640801","TextValue"=>"My! I can feel the magic is vibrating intensely. Its owner will soon arrive!"],
14224=>["Value"=>14224,"TextKey"=>"剧情ID31640901","TextValue"=>"Oh my goodness! Hill, my old pal!"],
14225=>["Value"=>14225,"TextKey"=>"剧情ID31640902","TextValue"=>"No way! I can't believe you are stuck here too! Oi oi, everyone! Let me introduce the King of Lion, Simba."],
14226=>["Value"=>14226,"TextKey"=>"剧情ID31640903","TextValue"=>"I have made a preliminary judgment about the surroundings here. There's no time to delay. Keep constructing and expanding territory."],
14227=>["Value"=>14227,"TextKey"=>"剧情ID30440301","TextValue"=>"This shabby wagon can barely shelter me from the wind and rain."],
14228=>["Value"=>14228,"TextKey"=>"剧情ID30440302","TextValue"=>"Lion King, you are right. We still need more time."],
14229=>["Value"=>14229,"TextKey"=>"剧情ID30440401","TextValue"=>"It is basic. However, that's a great model for further processing."],
14230=>["Value"=>14230,"TextKey"=>"剧情ID30440402","TextValue"=>"Improve the driver's seat. The long journey shall not be easy."],
14231=>["Value"=>14231,"TextKey"=>"剧情ID30440501","TextValue"=>"Nice! Guest seats also need to be improved. Watt and Wally, can you two please do us one more favor?"],
14232=>["Value"=>14232,"TextKey"=>"剧情ID30440601","TextValue"=>"Woohoo! Comfort level considerably increased. Well, I say we build it more confined. Privacy is no lesser than safety. Simba, I only suggested it because of our cooperation last time."],
14233=>["Value"=>14233,"TextKey"=>"剧情ID30440701","TextValue"=>"Indeed excellent! I've heard about your craftmanship, Watt and Wally. Too bad my lions only have fluffy paws, and this kind of delicate work is no match for lions."],
14234=>["Value"=>14234,"TextKey"=>"剧情ID30440702","TextValue"=>"Lol! Thanks for your appreciation, Lion King! There's still room for improvement. Wait and see what happens!"],
14235=>["Value"=>14235,"TextKey"=>"剧情ID30440801","TextValue"=>"Wally, can you add another story to it? The magic circulation requires height."],
14236=>["Value"=>14236,"TextKey"=>"剧情ID30440802","TextValue"=>"Gotcha! High-ceiling design is my expertise."],
14237=>["Value"=>14237,"TextKey"=>"剧情ID30440901","TextValue"=>"Watt and Wally, do you want to follow me to my Kingdom after all this? I guarantee that you will be treated even better than in Kingdom Hill."],
14238=>["Value"=>14238,"TextKey"=>"剧情ID30440902","TextValue"=>"Simba, I'm right here! I thought you would at least avoid me while poaching my staff!"],
14239=>["Value"=>14239,"TextKey"=>"剧情ID30441001","TextValue"=>"This castle means a lot to me. It allows me to live the spontaneous life I love and takes me to wherever I want."],
14240=>["Value"=>14240,"TextKey"=>"剧情ID30441002","TextValue"=>"Simba has been running freely over the fields. No wonder he wants a mobile castle to live in."],
14241=>["Value"=>14241,"TextKey"=>"剧情ID30441003","TextValue"=>"Watt and Wally, please take serious consideration into the advice I gave earlier."],
14242=>["Value"=>14242,"TextKey"=>"剧情ID31650301","TextValue"=>"Wow! It's getting better! But the portion for me is still too small."],
14243=>["Value"=>14243,"TextKey"=>"剧情ID31650401","TextValue"=>"The magic around the foods and the table are filling up. "],
14244=>["Value"=>14244,"TextKey"=>"剧情ID31650501","TextValue"=>"I'm a carnivore. But I know Hill's a sweet tooth. If you stay out of mine, I'll stay out of yours."],
14245=>["Value"=>14245,"TextKey"=>"剧情ID31650601","TextValue"=>"This reminds me of the old times when I host banquets. Though we are a little short of number, we can surely prepare a big meal for dinner tonight!"],
14246=>["Value"=>14246,"TextKey"=>"剧情ID31650701","TextValue"=>"This symbolized a fairy evening."],
14247=>["Value"=>14247,"TextKey"=>"剧情ID31650801","TextValue"=>"The magic is reaching the pinnacle. We can soon meet the owner of these yummy visions. "],
14248=>["Value"=>14248,"TextKey"=>"剧情ID31650901","TextValue"=>"…"],
14249=>["Value"=>14249,"TextKey"=>"剧情ID31650902","TextValue"=>"Hiya, lovely girl! What's your name?"],
14250=>["Value"=>14250,"TextKey"=>"剧情ID31650903","TextValue"=>"I… ummmm... I don't have a name. They call me "Little Match Girl". Perhaps… maybe... you can call me "Match"?"],
14251=>["Value"=>14251,"TextKey"=>"剧情ID31650904","TextValue"=>"Okay. Don't be afraid, kid. Come in and warm yourself up in our castle."],
14252=>["Value"=>14252,"TextKey"=>"剧情ID30450301","TextValue"=>"What's up, Match. Is this matchbox something you are thinking of?"],
14253=>["Value"=>14253,"TextKey"=>"剧情ID30450302","TextValue"=>"Yes, yes! If I curl up, I can squeeze myself in it, protecting myself against the wind."],
14254=>["Value"=>14254,"TextKey"=>"剧情ID30450401","TextValue"=>"Thank you, Watt! I can't imagine I can own a hut with beams one day. So happy!"],
14255=>["Value"=>14255,"TextKey"=>"剧情ID30450501","TextValue"=>"I can actually stand up inside the house. No more curling up. Hooray!"],
14256=>["Value"=>14256,"TextKey"=>"剧情ID30450601","TextValue"=>"Match, I think you'll like this windproof curtain."],
14257=>["Value"=>14257,"TextKey"=>"剧情ID30450602","TextValue"=>"Totally! I can save some matches to warm up now."],
14258=>["Value"=>14258,"TextKey"=>"剧情ID30450701","TextValue"=>"Ta-da~ The high-ceiling design I'm best at!"],
14259=>["Value"=>14259,"TextKey"=>"剧情ID30450702","TextValue"=>"Thank you so much! This is the prettiest house I've ever seen in my life… even better than those rich people's houses on the streets in the past."],
14260=>["Value"=>14260,"TextKey"=>"剧情ID30450801","TextValue"=>"If you can come up with one request for the house, what would it be?"],
14261=>["Value"=>14261,"TextKey"=>"剧情ID30450802","TextValue"=>"Ahhh… Owning a house is already beyond my expectation. I don't have any requests."],
14262=>["Value"=>14262,"TextKey"=>"剧情ID30450803","TextValue"=>"Not with that attitude, Match! C'mon, think harder! What do you really really really want?"],
14263=>["Value"=>14263,"TextKey"=>"剧情ID30450804","TextValue"=>"Umm… I think… that will be warmth. Yeah! I want it to be super warm!"],
14264=>["Value"=>14264,"TextKey"=>"剧情ID30450901","TextValue"=>"As long as we build four mansions like this, Little Match Girl will have her private castle!"],
14265=>["Value"=>14265,"TextKey"=>"剧情ID30451001","TextValue"=>"Are you guys serious? … This beautiful castle… is MINE?"],
14266=>["Value"=>14266,"TextKey"=>"剧情ID30451002","TextValue"=>"Of course, my dear child! This land is full of dangers. That's why we should value our accommodations. "],
14267=>["Value"=>14267,"TextKey"=>"剧情ID30451003","TextValue"=>"Waaah… Thank you! Thank you all!"],
14268=>["Value"=>14268,"TextKey"=>"剧情ID30451004","TextValue"=>"Go take some proper rest and be ready for the upcoming challenges!"],
14269=>["Value"=>14269,"TextKey"=>"剧情ID31660301","TextValue"=>"Fixation was a great idea. However, can we change its frame to a modern design? It looks not so transparent now."],
14270=>["Value"=>14270,"TextKey"=>"剧情ID31660401","TextValue"=>"Who will be the lamp holder?"],
14271=>["Value"=>14271,"TextKey"=>"剧情ID31660501","TextValue"=>"The fire is getting so much more bright! Morris, do you agree?"],
14272=>["Value"=>14272,"TextKey"=>"剧情ID31660502","TextValue"=>"Indeed, Your Majesty. This is a sign of enhanced magic."],
14273=>["Value"=>14273,"TextKey"=>"剧情ID31660601","TextValue"=>"Is this… a pumpkin? *Sweet'o'pumpkin, spooky'o'night* It's a perfect plant for my serenade!"],
14274=>["Value"=>14274,"TextKey"=>"剧情ID31660701","TextValue"=>"A lovely pumpkin lamp. It can be used as a decorative ornament."],
14275=>["Value"=>14275,"TextKey"=>"剧情ID31660702","TextValue"=>"It's hard to tell that the magic power it possessed is quite remarkable."],
14276=>["Value"=>14276,"TextKey"=>"剧情ID31660801","TextValue"=>"Did you guys notice that the impression of the pumpkin lamp just changed! It looks more and more like a human… Spooky..."],
14277=>["Value"=>14277,"TextKey"=>"剧情ID31660802","TextValue"=>"I have a hunch that this pumpkin friend will be meeting us soon."],
14278=>["Value"=>14278,"TextKey"=>"剧情ID31660901","TextValue"=>"Greetings, y'all! Ready for the spooky party at midnight?"],
14279=>["Value"=>14279,"TextKey"=>"剧情ID31660902","TextValue"=>"Pumpkinhead! Don't scare young kids. By the way, is your head ripe and sweet when you pick it?"],
14280=>["Value"=>14280,"TextKey"=>"剧情ID31660903","TextValue"=>"Ummm… actually pumpkins are not edible for they contain a toxic chemical called "pumpkin acid". And don't call me pumpkinhead, my name is Jack!"],
14281=>["Value"=>14281,"TextKey"=>"剧情ID31660904","TextValue"=>"Alright, Jack. That is a lie. Are you afraid I'm going to eat you?"],
14282=>["Value"=>14282,"TextKey"=>"剧情ID31660905","TextValue"=>"… See you, Mr. King!"],
14283=>["Value"=>14283,"TextKey"=>"剧情ID30460301","TextValue"=>"For me, straws are the best protection against cold."],
14284=>["Value"=>14284,"TextKey"=>"剧情ID30460401","TextValue"=>"Help me think… what are the things people might be startled at first glance? Oh right! Skeleton! I want to put a skeleton set on my front gate. "],
14285=>["Value"=>14285,"TextKey"=>"剧情ID30460501","TextValue"=>"Why don't you add something pumpkins to your façade? Just like what I did to mine with carrots."],
14286=>["Value"=>14286,"TextKey"=>"剧情ID30460601","TextValue"=>"Do you want to open a skylight, Mr. Jack? To do that, we have to take off the skeleton décor."],
14287=>["Value"=>14287,"TextKey"=>"剧情ID30460701","TextValue"=>"I really like it! But I feel that pumpkin can be bigger. Can you help me out?"],
14288=>["Value"=>14288,"TextKey"=>"剧情ID30460702","TextValue"=>"Sure thing. You can always trust Watt with carving."],
14289=>["Value"=>14289,"TextKey"=>"剧情ID30460801","TextValue"=>"Wow, soooooo beautiful! Hem hem, no, I mean… I still need a lantern on it! Yup, a lantern!"],
14290=>["Value"=>14290,"TextKey"=>"剧情ID30460901","TextValue"=>"This mansion looks like a large Jack! Hah-hah-hah, a small Jack living in a big Jack!"],
14291=>["Value"=>14291,"TextKey"=>"剧情ID30461001","TextValue"=>"Wow, my pumpkin, my straws, my lantern! Watt and Wally, you two are simply geniuses! I announce that you two are officially on top of my PRANKING LIST!"],
14292=>["Value"=>14292,"TextKey"=>"剧情ID30461002","TextValue"=>"Oh geez, cut me some slacks. But please do not let Watt escape!"],
